INSERT INTO `data_literature_dump` VALUES ('1', 'APPLICATION AND VALIDATION OF A DIRECTIONAL SOLIDIFICATION MODEL AND DENDRITE MORPHOLOGY CRITERION FOR COMPLEX,SINGLE-CRYSTAL CASTINGS', 'Michael D. Marotta;David C. Dudzinski;', '2016-12-15', 'Inconel 718;constitutive;creep;fatigue;multiaxial;nickel;oxidation;superalloy', 'A low cycle fatigue (LCF) model for IN718 has been developed using data from public sources cited in the Metallic Materials Properties Development and Standardization (MMPDS-01) [1] and the Aerospace Structural Metals (ASM) Handbook [2]. A temperature range of 21 to 760 ¬∞C (70 to 1400 ¬∞F) with elastic stress concentration factor (Kt) values from 1.0 to 3.0 were considered for lives up to two million cycles. The model is strain- based, modified by a Walker-based stress shakedown routine [3]. Creep and oxidation from thermal exposure are considered. Geometric effects are captured using a factor based on the stress dieout at the notch root (i.e. the gradient of the elastic stress at the root of the notch as a function of depth). This approach demonstrates good capability in collapsing a wide range of test conditions and geometries.', 'C', 'Derivation Research Laboratory', '0', '0', '10.1016/s1359-6454(99)00217-7', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\A Unified LCF Model for Conventionally Heat Treate.pdf', '0', '0', '153');
INSERT INTO `data_literature_dump` VALUES ('2', 'A MULTI-SCALE MULTI-PHYSICS APPROACH TO MODELLING OF ADDITIVE MANUFACTURING IN NICKEL-BASED SUPERALLOYS', 'C. Panwisawas;Y. Sovani;M.J. Anderson;R. Turner;N.M. Palumbo;B.C. Saunders;I. Choquet;J.W. Brooks;H.C. Basoalto', '2016-12-15', 'Multi-scale modelling;Additive manufacturing;Thermal fluid dynamics;IN718;Aerospace component', 'A multi-scale, multi-physics modelling framework of selective laser melting (SLM) in the nickel-based superalloy IN718 is presented. Representative powder-bed particle distribution is simulated using the measured size distribution from experiment. Thermal fluid dynamics calculations are then used to predict melting behaviour, sub-surface morphology, and porosity development during a single pass scanning of the SLM process. The results suggest that the pores and uneven surface structure are exacerbated by increasing powder layer thicknesses. Predicted porosity volume fraction is up to 12% of the single track when 5 statistical powder distributions are simulated for each powder layer thickness. Processing-induced microstructure is predicted by linking cellular automatons ‚Äì finite element calculations indicate further that the cooling rate is about 4400 oC/s and grain growth strongly follows the thermal gradient giving rise to a columnar grain morphology if homogeneous nucleation is assumed. Random texture is likely for as-fabricated SLM single pass with approximately 8 \0m and 6 \0m grain size for 20 \0m and 100 \0m powder layer thickness fabrication. Use has been made of the cooling history to predict more detailed microstructure using a Œ≥\" precipitation model. With the short time scale of solidification and rapid cooling, it becomes less likely that Œ≥\" precipitation will be observed in the condition investigated unless a prolonged hold at temperature is carried out. Future work on extension of the proposed multiscale modelling approach on microstructure predictions in SLM to mechanical properties will be discussed.', 'C', 'School of Metallurgy and Materials;Rolls-Royce plc;Department of Engineering Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\A Multi-Scale Multi-Physics Approach to Modelling .pdf', '0', '0', '155');
INSERT INTO `data_literature_dump` VALUES ('3', 'A NEW ANALYSIS OF THE MICROSTRUCTURE OF N\0-BASED SINGLE-CRYSTAL SUPERALLOYS: RELEVANT TOPOLOGICAL PARAMETERS FOR EFFICIENT MICROSTRUCTURAL MODELING', 'M. Degeiter;M. Perrut;B. Appolaire;Y. Le Bouar;A. Finel', '2016-12-15', 'single-crystal superalloy;precipitation;microstructure;elasticity;modeling;pattern formation;phase diffusion', 'Two topological parameters derived from pattern for- mation theory are introduced, and their relevance for the description of the elasticity-induced coarsening in Ni-based single-crystal superalloys is investigated. For that purpose, and given the crucial role of the spa- tial arrangement of the precipitates on microstructure evolution, two-dimensional phase field calculations of ideal microstructures undergoing slight perturbations have been carried out. The response of the system against Eckhaus and zigzag perturbations is discussed and quantitatively described by means of the developed topological parameters.', 'C', 'Onera - The French Aerospace Lab;LEM', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\A New Analysis of the Microstructure of Ni-Based S.pdf', '0', '0', '156');
INSERT INTO `data_literature_dump` VALUES ('4', 'A STUDY ON THE EFFECTS OF SUBSTRATE CRYSTALLOGRAPHIC ORIENTATION ON MICROSTRUCTURAL CHARACTERISTICS OF RENEÃÅ N5 PROCESSED THROUGH SCANNING LASER EPITAXY', 'Amrita Basak;Suman Das', '2016-12-15', 'Nickel-Base;Superalloys;Single-Crystal;ReneÃÅ N5;Additive Manufacturing;Scanning Laser Epitaxy', 'In this work, the single-pass fabrication of more than 1000 \0m thick ReneÃÅ N5, a high \0\0 and ‚Äúnon-weldable‚Äù single-crystal superalloy on top of investment cast ReneÃÅ N5 substrates having <100> and <001> crystallographic orientations through scanning laser epitaxy (SLE) was demonstrated. SLE is a powder-bed fusion based additive manufacturing (AM) process that was exclusively developed to repair and manufacture gas turbine hot- section components made of nickel-base superalloys. The microstructures of the ReneÃÅ N5 deposits were investigated using optical imaging, scanning electron microscopy (SEM), energy dispersive X-ray spectroscopy (EDS), and electron back scatter diffraction (EBSD). Optical microscopy revealed that the substrate crystallographic orientation of <100> did not prohibit dendritic growth along the <001> direction in the deposit region. Scanning electron microscopy investigations showed the presence of finer microstructure in the deposit region compared to the substrate region. The crack-free deposits obtained for ReneÃÅ N5 represent one of the few successes reported for a ‚Äúnon-weldable‚Äù single-crystal superalloy of its kind using powder-bed based AM process.', 'C', 'George W. Woodruff School of Mechanical Engineering;School of Materials Science and Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\A Study on the Effects of Substrate Crystallograph.pdf', '0', '0', '157');
INSERT INTO `data_literature_dump` VALUES ('5', 'ADVANCED SUPERSOLVUS NICKEL POWDER DISK ALLOY DOE: CHEMISTRY, PROPERTIES, PHASE FORMATIONS AND THERMAL STABILITY', 'Andrew Powell;Ken Bain;Andrew Wessman;Daniel Wei;Timothy Hanlon;David Mourer', '2016-12-15', 'Alloy Development;Powder Metallurgy;superalloy;chemistry;disk alloy design;phase stability', 'GE Aviation under the US Air Force Hybrid Disk Contract (FA8650-10-C-5225) investigated a powder nickel alloy design space in search of an alloy composition to increase the state of the art temperature capability for rotating disk applications to 1450 oF (788 oC). The eleven alloy Design of Experiments (DOE) explored the relationship between chemistry and mechanical properties (creep, tensile, ductility, dwell LCF, cyclic fatigue crack growth & static fatigue crack growth) as well as identified key attributes around gamma prime precipitation temperatures, phase stability and long term exposures and stability of gamma prime. Regression analysis of the data obtained indicates that increasing W and decreasing Cr and Ti are desirable for improved high temperature strength and creep capability.', 'C', 'GE Aviation;GE Global Research', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Advanced Supersolovus Nickel Powder Disk Alloy DOE.pdf', '0', '0', '158');
INSERT INTO `data_literature_dump` VALUES ('6', 'Alloying Effects on Microstructural Stability and Œ≥.\' Phase Nano-Hardness in Co-Al-W-Ta-Ti-Base Superalloys', 'H.J.Zhou;W.D.Li;F.Xue;L.Zhang;X.H.Qu;Q.Feng', '2016-12-15', 'Co-base;alloying elements;phase equilibria;microstructural stability;nano-hardness', 'In previous work,Co-Al-W-Ta-Ti quinary alloys were found to show excellent creep resistance and microstructural stability at higher temperature as well as high Œ≥\' solvus temperature.In the current research,alloying effects on microstructural evolution,phase equilibria at 1000~1100‚ÑÉ as well as Œ≥\' phase nano-hardness were investigated in Co-Al-W-Ta-Ti-X alloys(X=Cr,Mo,Nb,Ni and V).Phase diagram calculations were also performed using Pandat.It is suggested that Ni and V additions increased Œ≥\' solvus temperature,while Cr,Mo and Nb additions presented a negative effect.The composition of the baseline alloy is located in the Œ≥+Œ≥\' two phase region at 1000~1050‚ÑÉ but lies in the Œ≥+Œ≥\'+X+Œ≤ phase region at 1100‚ÑÉ.Additions of Cr,Nb,V and Mo strongly promoted the precipitation of X phase at 1100‚ÑÉ,while Œ≤ phase co-existed in alloys containing Cr and V,respectively.Ni addition enlarged the Œ≥+Œ≥\' two phase region obviously in the investigated temperature range.The above experimental results generally suggested that Œ≥+Œ≥\' two phase region is smaller than the calculated phase equilibria.Nano indentation measurements showed that alloying additions increased Œ≥\' nano-hardness (Œ≥\' hardness) in the following order:V > Nb > Mo ‚âà Ni,while Cr addition showed the negative effect distinctly.The current study is helpful to understand phase equilibria and microstructure in Co-Al-W-Ta-Ti-Base alloys and further develop multi-component Œ≥\'-strengthened Co-base superalloys.', 'C', 'State Key Laboratory for Advanced Metals and Materials;Institute for Advanced Materials and Technology', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Alloying Effects on Microstructural Stability and .\' Phase Nano-Hardness in Co-Al-W-Ta-Ti-Base Superalloys.pdf', '0', '0', '159');
INSERT INTO `data_literature_dump` VALUES ('7', 'ALLOYS-BY-DESIGN: TOWARDS OPTIMIZATION OF COMPOSITIONS OF NICKEL-BASED SUPERALLOYS', 'Roger C. Reed;Alessandro Mottura;David J. Crudden', '2016-12-15', 'alloy development;nickel-superalloy;materials genome', 'The composition of a range of different nickel-based superalloys are isolated using theory-based computational modeling, termed ‚ÄòAlloys-by-Design‚Äô methods. Each alloy has been designed with different applications in mind. A polycrystalline alloy is designed for turbine disc applications, here emphasis is placed on the composition dependence of strength. Examples of the design trade- offs faced when increasing alloy strength are presented. Three new single crystal alloy compositions are designed. They are (i) a second generation type alloy with a reduced level of rhenium, (ii) a creep resistant alloy designed for high performance jet applications and (iii) a low cost corrosion resistant alloy designed specifically for industrial gas turbine applications. In each case the newly designed alloys have been manufactured. Design critical properties are measured and compared with modeling predictions to test the accuracy of this alloy design approach.', 'C', 'Department of Materials;School of Metallurgy and Materials', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Alloys-by-Design_ Towards Optimization of Composit.pdf', '0', '0', '160');
INSERT INTO `data_literature_dump` VALUES ('8', 'AN APPROACH TO MICROSTRUCTURE MODELLING IN NICKEL BASED SUPERALLOYS', 'Aleksey Reshetov;Olga Bylya;Nicola Stefani;Malgorzata Rosochowska;Paul Blackwell', '2016-12-15', 'ATI 718Plus¬Æ;Microstructure evolution;FEM;Recrystallisation;Grain Growth;Plastic work;Aerofoil Manufacturing Process', 'Mechanical properties of components made from nickel based superalloys rely on the microstructure that forms during their thermomechanical processing. The ability for predicting and controlling microstructure during the processing is of the utmost importance for this class of alloys. In this work, the applicability of JMAK-type (Johnson-Mehl-Avrami-Kolmogorov) models is studied in the context of industrial manufacturing processes. The results of FEA (finite element analysis) based predictions of microstructure evolution in ATI 718Plus¬Æ alloy during the hot deformation process are presented. The limitations of the JMAK- type approach are discussed in the paper and concepts for an alternative modelling approach for microstructure prediction in nickel based superalloys are presented.', 'C', 'Advanced Forming Research Centre;Department of Design', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\An Approach to Microstructure Modelling in Nickel .pdf', '0', '0', '161');
INSERT INTO `data_literature_dump` VALUES ('9', 'ANISOTHERMAL HIGH-TEMPERATURE CYCLIC BEHAVIOR OF A N\0-BASED SINGLE CRYSTAL SUPERALLOY', 'Jean-Briac le Graverend;Jonathan Cormier;Franck Gallerneau;Serge Kruch;JoseÃÅ Mendez', '2016-12-15', 'Ni-based Single-Crystal Superalloy;Creep;Anisothermal Loading;Cycling Loading;Œ≥\0‚Äô Precipitation', 'Dwell-fatigue tests and variable strain rate tensile tests followed by cycling tests were performed using <001>-oriented specimens made of a first-generation Ni-based single crystal superalloy. A short thermal jump from the nominal temperature of 1050¬∞C to 1200¬∞C was introduced along the lifetime of dwell-fatigue experiments and at the beginning of tensile tests. Once such thermal loading was applied, a fine \0‚Äô precipitation occurred in the \0 matrix and induced a large transient strengthening effect on the mechanical properties. Indeed, a transient decrease of the plastic strain rate, corresponding to a reduced magnitude in the hysteresis loops, was measured due to the temperature peak during the dwell- fatigue experiments. In addition, a temperature peak produced a large hardening effect during the tensile tests since a hardening of 160 MPa was created. These transient phenomena are due a temporary additional strengthening provided by fine \0‚Äô precipitates lasting for the time necessary for their dissolution.', 'C', 'Texas A&M University;Institut Pprime;TeÃÅleÃÅport 2;Office National d‚ÄôEtudes et de Recherches AeÃÅrospatiales', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Anisothermal High-Temperature Cyclic Behavior of a.pdf', '0', '0', '162');
INSERT INTO `data_literature_dump` VALUES ('10', 'APPLICATION AND VALIDATION OF A DIRECTIONAL SOLIDIFICATION MODEL AND DENDRITE MORPHOLOGY CRITERION FOR COMPLEX,SINGLE-CRYSTAL CASTINGS', 'J.D.Miller;K.J.Chaput;D.S.Lee;M.D.Uchic', '2016-12-15', 'directional solidification;process modeling;dendrite growth', 'Extensive work is required to determine optimal processing conditions (e.g. withdrawal,rate furnace temperature) for directional solidification of single crystal castings in the complex geometries required for modern flight hardware.Prior work used fundamental solidification theory and modeling to adapt classical defect-formation criteria to realistic non-planar solidification and develop a geometric-independent metric for preferred casting conditions.The continuation of this work consists of applying and validating these learned metrics to representative blade geometries.The overarching objective is to develop an integrated set of modeling tools capable of linking process parameters and alloy properties to modern design methods through the prediction of critical microstructural features:dendritic structure,defect formation,and porosity.Thermocouple measurements from directional solidification experiments and full-cross-section metallographic characterization of resulting castings have been compared to model predictions and show good agreement.New parameters from solidification models have been developed and demonstrated for the onset and extent of dendrite morphology changes in a turbine blade geometry.', 'C', 'Materials and Manufacturing Directorate', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Application and Validation of a Directional Solidi.pdf', '0', '0', '163');
INSERT INTO `data_literature_dump` VALUES ('11', 'ATI718PLUS¬Æ ‚Äì NEW NICKEL BASED DISC ALLOY AND ITS CAPABILITY', 'D. Huenert;M. Proebstle;A. Casanova;R. Schluetter;R. Krakow;M. Buescher;P. Randelzhofer;A. Evans;K. Loehnert;T. Witulski;S. Neumeier;C. Rae', '2016-12-15', 'ATI718Plus¬Æ alloy; FCG;tensile; creep; oxidation; long term stability', 'Two extreme microstructural variants of alloy ATI718PLUS¬Æ were investigated regarding their tensile strength, creep resistance, long-term stability, oxidation and crack growth properties. The variants were produced by supersolvus and subsolvus forging procedures. A subsolvus forging produces fine-grained microstructure with aligned blocky secondary Œ∑-phase. The supersolvus forging generated a coarser grain size with improved creep performance and non-aligned lamellar Œ∑-phase. The oxidation behavior has been characterized showing superior performance of ATI718PLUS¬Æ relative to alloy 718 and 720LI. The results have been used to design optimized microstructures balancing the properties required for critical rotating parts. The analysis of several test conditions show, that key properties can be altered over a wide range.', 'C', 'Rolls Royce Deutschland;Otto Fuchs KG;Friedrich-Alexander University Erlangen-NuÃàrnberg;Friedrich-Alexander University Erlangen-NuÃàrnberg Germany;Department of Materials Science and Metallurgy', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\ATI718Plus¬Æ ‚Äì New Nickel Based Disc Alloy and Its .pdf', '0', '0', '164');
INSERT INTO `data_literature_dump` VALUES ('12', 'BENCHMARKING CRYSTAL PLASTICITY MODELS WITH MICROTENSILE EVALUATION AND 3D CHARACTERIZATION OF RENEÃÅ 88DT', 'David W. Eastman;Zafir Alam;George Weber;Paul A. Shade;Michael D. Uchic;William C. Lenthe;Tresa M. Pollock;Kevin J. Hemker', '2016-12-15', 'ReneÃÅ 88DT;Microtensile;ICME', 'Microtensile tests of the polycrystalline Ni-base superalloy ReneÃÅ 88DT have been designed and carried out in order to guide and benchmark parallel multiscale modeling efforts at appropriate length scales. Microtensile samples of ReneÃÅ 88DT have been machined with gage thicknesses of 20, 200, 400 and 500 Œºm using a variety of techniques including wire electrical discharge machining (EDM), focused ion beam (FIB) and femtosecond laser machining. Loading in uniaxial tension yielded the stress-strain behavior of oligocrystalline samples with well-defined boundary conditions and computationally tractable numbers of grains. The polycrystalline microstructures of deformed 20 Œºm thick samples have been collected in 3D using laser-based serial sectioning combined with electron backscatter diffraction (EBSD) and are being used as an explicit input for crystal plasticity finite element simulations. The experimentally measured flow strengths were found to vary with sample size, with smaller samples possessing more scatter and an overall reduction in strength. This effect has been attributed to both reduced constraints in surface grains and to finite sampling of grain orientations with a biased distribution of Schmid factor values. Further analysis including local surface strain measurements obtained with digital image correlation indicate that only a few grains dominate the loading response at very small length scales, which contributes to both the increased scatter and reduced strength. These oligocrystal results both highlight the stochastic nature of plasticity in small volumes and provide explicit benchmarks for crystal plasticity simulations.', 'C', 'Johns Hopkins University;Air Force Research Laboratory;University of California Santa Barbara', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Benchmarking Crystal Plasticity Models with Microt.pdf', '0', '0', '165');
INSERT INTO `data_literature_dump` VALUES ('13', 'CHARACTERIZATION AND MODELING OF DEFORMATION MECHANISMS IN N\0-BASE SUPERALLOY 718', 'D. McAllister;D. Lv;H. Deutchman;B. Peterson;Y. Wang;M.J. Mills', '2016-12-15', 'Superalloy;718;characterization;modeling;yield;phase field;STEM', 'Alloy 718 is a prominent material used in the aerospace industry for turbine disk applications. Though there has been a plethora of processing/property relationship data collected over its 50 year life, relatively little is known about the deformation mechanisms dictating the yield strength of the alloy and how they relate to the microstructure and morphology of the Œ≥‚Ä≤‚Ä≤ phase. The purpose of this study was to understand the precipitation and growth of Œ≥‚Ä≤‚Ä≤ in standard samples as well as the deformation mechanisms prominent in alloy 718 across its usable temperature range. These mechanisms were then used to inform predictive yield strength models based on phase field simulations. It was found that Œ≥‚Ä≤‚Ä≤ forms composite precipitates that increase in their complexity during standard dual step heat treatments. Additionally, it has been shown that Œ≥‚Ä≤‚Ä≤ is sheared by complex mechanisms that involve both full 1/2<110> dislocations and partials of multiple types. The deformation mechanisms can be compared to phase field modeling simulations that are then used to inform fast acting yield strength models.', 'C', 'The Ohio State University;Honeywell Aerospace', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Characterization and Modeling of Deformation Mecha.pdf', '0', '0', '166');
INSERT INTO `data_literature_dump` VALUES ('14', 'CHARACTERIZATION OF GRAIN BOUNDARIES AND ASSOCIATED MINOR PHASES IN DISK ALLOY ME3 EXPOSED AT 815 ¬∞C', 'Chantal K. Sudbrack;Laura J. Evans;Anita Garg;Daniel E. Perea;Daniel K. Schreiber', '2016-12-15', 'Ni-based superalloys;Carbide;Boride;Sigma;TCP;Precipitation', 'The objective of this work was to address the effect of 815 ¬∞C exposures on the chemistry of interior grain boundaries and associated minor phases from the fatigued volume of tested notched low cycle fatigue (NLCF) specimens of an advanced powder metallurgy superalloy ME3, which is used in turbine disk applications. Prior to NLCF testing at 704 ¬∞C in air, selected ME3 specimens were pre-exposed at 815 ¬∞C for exposures times up to 2,020 h to capture projected service conditions for the turbine disk rim. Structure, compositions and size distributions of minor phases, including MC carbides, M23C6 carbides, M3B2 borides and sigma, were identified. Minor phase compositions and grain boundary chemistries for various conditions were evaluated with atom probe tomography, transmission electron microscopy and high-resolution x-ray energy-dispersive spectroscopy, allowing their evolution and relationship to failure modes to be considered.', 'C', 'NASA Glenn Research Center;Environmental Molecular Sciences Laboratory;Pacific Northwest National Laboratory', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Characterization of Grain Boundaries and Associate.pdf', '0', '0', '167');
INSERT INTO `data_literature_dump` VALUES ('15', 'CHARACTERIZATION OF TILT AND TWIST LOW ANGLE GRAIN BOUNDARIES AND THEIR EFFECTS ON INTERMEDIATE-TEMPERATURE CREEP DEFORMATION BEHAVIOUR', 'Yao Wang;Dong Wang;Gong Zhang;Langhong Lou;Jian Zhang', '2016-12-15', 'Low angle grain boundary;Creep deformation;Single crystal Ni-based superalloy;Dislocation', 'The characterization of tilt and twist low angle grain boundaries (LAGBs) has been performed, and the influences of LAGBs on intermediate-temperature creep deformation behavior have been investigated in a single crystal Ni-based superalloy. It is found that the tilt boundary is composed of intrinsic edge dislocations, and the twist boundary mainly consists of intrinsic screw dislocations. LAGB type is found to have a significant influence on the rupture life of SX superalloy deformed at 760 oC. The tilt boundary shows a much better creep resistance compared to that of a twist boundary. The dislocation configuration near the grain boundary indicates that most of the mobile dislocations can pass through the tilt boundary, but they are basically inhibited and piled-up at the twist boundary during creep deformation.', 'C', 'Superalloys Division;Shenyang National Laboratory for Materials Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Characterization of Tilt and Twist Low Angle Grain.pdf', '0', '0', '168');
INSERT INTO `data_literature_dump` VALUES ('16', 'CMSX-4¬Æ PLUS SINGLE CRYSTAL ALLOY DEVELOPMENT, CHARACTERIZATION AND APPLICATION DEVELOPMENT', 'Jacqueline B. Wahl; Ken Harris', '2016-12-15', 'CMSX-4¬Æ Plus;Cast;Single Crystal;Alloy Development;Properties', 'Ongoing demand for advanced gas turbines with lower fuel burn and commensurate reduced CO2 emissions require single crystal (SX) superalloys that can be cast into complex cooled turbine blades and vanes, including dual wall, capable of operating at higher gas and metal temperatures beyond the capability of 2nd generation, 3% rhenium (Re)-containing SX alloys, currently used extensively in commercial and military flight engines. These castings must have an excellent balance of high temperature mechanical properties, producibility, oxidation/hot corrosion resistance, coating compatibility and phase stability. The highest strength nickel-base SX superalloys, without ruthenium, currently in production (3rd generation CMSX-10K¬Æ and CMSX-10N¬Æ alloys) contain 6-7% Re. These highly alloyed, specialty alloys have in some applications demonstrated drawbacks including secondary reaction zone (SRZ) phase instability in the base alloy adjacent to the coatings, low temperature internal oxidation/hot corrosion attack and difficulty in production solution heat treatment. In addition, current 3rd generation SX alloys have high density which is a disadvantage in terms of weight and inertia for rotating part applications, and high cost due to the elevated Re content. In response, Cannon-Muskegon (CM) has developed an improved, lower Re content 3rd generation SX superalloy, CMSX-4¬Æ Plus, suitable to replace both current 2nd and 3rd generation SX alloys, with improved properties and performance and lacking the drawbacks of current 3rd generation SX alloys. The development and characterization of CMSX-4 Plus alloy, including composition, mechanical and physical properties are detailed in this paper.', 'C', 'Cannon-Muskegon¬Æ Corporation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\CMSX-4¬Æ Plus Single Crystal Alloy Development, Cha.pdf', '0', '0', '169');
INSERT INTO `data_literature_dump` VALUES ('17', 'CONVENTIONALLY FORGED RR1000 BILLET FOR FORGED TURBINE COMPONENTS', 'Kevin J. Bockenstedt;Christopher M. O‚ÄôBrien;Ramesh S. Minisandram;George J. Smith;David J. Bryant', '2016-12-15', 'Powder Metal;RR1000;Forging', 'High temperature powder alloys used in the manufacture of critical rotating aircraft engine components are typically converted to billet via a hot consolidation and extrusion route, with subsequent forging to final disk configurations performed in an isothermal press. As an alternate manufacturing route, ATI has developed a conventional thermo-mechanical billet conversion process for the Rolls-Royce powder metallurgy superalloy RR1000. Over the past 20 years a combination of hot isostatic pressing (HIP) processing and conventional billet conversion techniques have been explored with varying success. Through a combination of unique equipment and controlled process sequencing, acceptable billet has been produced and isothermally forged into disks for turbine and compressor applications. These components meet the combination of microstructure and mechanical properties required in advanced turbine machinery. This represents the first commercial application for this production route.', 'C', 'ATI Specialty Materials;Rolls-Royce plc.', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Conventionally Forged RR1000 Billet for Forged Tur.pdf', '0', '0', '170');
INSERT INTO `data_literature_dump` VALUES ('18', 'CRACK INITIATION AND PROPAGATION DURING THERMAL-MECHANICAL FATIGUE OF IN792:EFFECTS OF DWELL TIME', 'Paraskevas Kontis;David M.Collins;Sten Johansson;Angus J.Wilkinson;Johan J.Moverare;Roger C.Reed', '2016-12-15', 'Deformation ;carbides;strain mapping', 'Thermal-mechanical fatigue (TMF) fatigue crack growth measurements are performed on the polycrystalline alloy IN792,in mechanical strain control and in the temperature range 100-750‚ÑÉ.The effect of both in-phase(IP) and out-of-phase(OP) TMF cycles on the crack growth rate are investigated and the impact of prolonged dwell times at the highest investigated temperature is emphasised.Scanning electron microscopy(SEM) including electron backscatter diffraction(EBSD) techniques are used to characterise the cracking phenomena;cross-correlation-based analysis of EBSD patterns is used to obtain high resolution maps of lattice rotation and elastic strains near second phases such as carbides.The six hours dwell time at maximum temperature increases crack growth rate for both types of TMF;higher rates are observed in the case of IP.MC-type carbides are found to play an important role in crack initiation performance of IN792 by decreasing the crack initiation life,particularly in the IP-tests.Finally,a transition from transgranular to intergranular crack propagation was observed for the IP-test as dwell time increased,the transgranular character of the cracking in the OP-tests was not affected by the dwell time.', 'C', 'Department of Materials;Engineering Materials', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Crack Initiation and Propagation during Thermal-Me.pdf', '0', '0', '171');
INSERT INTO `data_literature_dump` VALUES ('19', 'CREEP AND OXIDATION BEHAVIOUR OF COATED AND UNCOATED THIN WALLED SINGLE CRYSTAL SAMPLES OF THE ALLOY PWA1484', 'Fabian Krieg;Mike Mosbacher;Markus Fried;Ernst Affeldt;Uwe Glatzel', '2016-12-15', 'PWA1484;thickness debit effect;NiAl-coating', 'The creep and oxidation behavior of the second generation nickel- based superalloy PWA1484 is investigated. Particular attention is given to the testing of thin samples with a maximum thickness of 1.0 mm. The specimen were uncoated or aluminized. The oxidation experiments were carried out stress free up to 1000h at temperatures of 980 ¬∞C and 1100 ¬∞C in ambient air. The uncoated samples show three different oxide layers at both temperatures followed by a small altered region of the initial \0/\0\0-microstructure. The thickness of each layer is growing with extended oxidation times. In contrast, the aluminized samples show a small oxide layer of about one micron, but after long exposition to high temperatures a formation of TCP-phases. These phases have a needle to plate- like structure and extend far into the original structure. In addition, the NiAl coating converts to a martensitic structure. Uncoated and aluminized specimens were tested in creep at temperatures of 980 ¬∞C and 1100 ¬∞C with stresses up to 170 MPa in air. Both, the uncoated and aluminized samples show a great scatter in rupture time and strain rate at a temperature of 980 ¬∞C regardless of the sample thickness. The thickness debit effect was not observable. However, at temperatures of 1100 ¬∞C the thickness debit effect was clearly measured with both sample types. The scatter in rupture time and minimum creep rate is small.', 'C', 'Metals and Alloys;MTU Aero Engines AG', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Creep and Oxidation Behaviour of Coated and Uncoat.pdf', '0', '0', '172');
INSERT INTO `data_literature_dump` VALUES ('20', 'CREEP DEFORMATION OF A 6th GENERATION N\0-BASE SINGLE CRYSTAL SUPERALLOY AT 800 oC and 735 MPa', 'Y. Yuan;K. Kawagishi;Y. Koizumi;T. Kobayashi;T. Yokokawa;H. Harada', '2016-12-15', 'Ni-base superalloy;Sixth generation;Single crystal;Creep mechanism;Stacking fault energy', 'The latest Ru-bearing 6th generation Ni-base single crystal superalloy TMS-238 developed at National Institute for Materials Science (NIMS) in Japan is a promising candidate for applications as gas turbine blades. Fundamental understanding of the creep deformation processes is necessary for alloy design and performance. In this study, the creep tests of MX-4/PWA 1497 (a 4th generation Ni-base single crystal) and TMS-238 were conducted at 800 oC and 735 MPa along [001]. For creep strain of 0.1%, TMS-238 had a creep time more than sixty times longer than MX-4/PWA 1497. Microstructural observations showed that stacking faults (SFs) sheared both the Œ≥ matrix and Œ≥\' precipitates in MX-4/PWA 1497, however, SFs sheared only the Œ≥ matrix in TMS-238. After creep rupture, a high density of dislocations was observed in MX-4, whereas a number of planar defects were formed in TMS-238. The factors that affect the creep deformation are discussed. The results imply that the stacking fault energy (SFE) of Œ≥ matrix in TMS-238 is lower than that in MX-4. Higher additions of Re and Ru are responsible for the lower SFE in TMS- 238. The creep deformation processes in the two superalloys are different, primary creep stage and tertiary creep stage are dominant in MX-4 and TMS-238, respectively.', 'C', 'National Institute for Materials Science;Currently at Xi‚Äôan Thermal Power Research Institute Co.Ltd.', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Creep Deformation of a 6th Generation Ni-Base Sing.pdf', '0', '0', '173');
INSERT INTO `data_literature_dump` VALUES ('21', 'DAMAGE EVOLUTION DURING COMPRESSIVE HOLD SUSTAINED PEAK LOW CYCLE FATIGUE OF A N\0-BASED SINGLE-CRYSTAL SUPERALLOY', 'Swapnil Patil;Shenyan Huang;Mallikarjun Karadge;Doug Konitzer;Akane Suzuki', '2016-12-15', 'hold-time fatigue;crack growth;hysteresis loops;creep', 'The damage evolution in a Ni-base single-crystal superalloy during compressive hold sustained peak low cycle fatigue (SPLCF) was investigated by conducting series of interrupted SPLCF tests using ReneÃÅ N5 at 982 and 1093 ¬∞C. Evolution of hysteresis loops and microstructure in the bulk away from surface cracks were analyzed to understand bulk damage accumulation. Tensile stress developed during SPLCF was found to be a key factor for crack propagation and life. Bulk deformation away from cracks showed a signature of dominant creep deformation, including Œ≥\' rafting and formation of interfacial dislocation networks. Crack depth measurements along with detailed microstructural investigations of cracks were performed to understand crack growth behavior. Based on the experimental results, a comprehensive SPLCF crack growth model was developed by combining a finite element method (FEM) simulation of oxide induced crack growth and linear elastic fracture mechanics (LEFM) based approach.', 'C', 'General Electric Global Research;General Electric Global Research;General Electric Aviation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Damage Evolution during Compressive Hold Sustained.pdf', '0', '0', '174');
INSERT INTO `data_literature_dump` VALUES ('22', 'DEFECT FORMATION AND ITS MITIGATION IN SELECTIVE LASER MELTING OF HIGH \0Œ≥\' N\0-BASE SUPERALLOYS', 'Xiqian Wang;Noriko Read;Luke N. Carter;R. Mark Ward;Moataz M. Attallah', '2016-12-15', 'CM247LC;Selective Laser Melting;Precipitates;Cracks;Texture', 'This report focuses on the microstructural causes of cracking in CM247LC processed using Selective Laser Melting (SLM), as well as other phenomena that may increase the likelihood for cracking. Observations using high-speed imaging showed that material was lost as both vapor and discrete particles under some conditions, which may be a source of the Al-enriched particles found in recycled powder. The local chemical heterogeneities arising from such Al-rich particles may then contribute to crack and pore formation. Transmission Electron Microscopy (TEM) investigations for the as-built microstructure showed ‚Äúcell-like‚Äù structures within the columnar grains, Hf-rich precipitates were found at ‚Äúcell-like‚Äù structures and grain boundaries, and there were associated high dislocation densities at these boundaries acting as crack initiation points in the presence of residual stresses. Post-process Hot Isostatic Pressing (HIP) was used to heal the cracks and pores that form during processing. It was found to lead to pronounced recrystallization, as expected from the high dislocation density. Various routes for defect mitigation are discussed.', 'C', 'University of Birmingham', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Defect Formation and Its Mitigation in Selective L.\' Ni-Base Superalloys.pdf', '0', '0', '175');
INSERT INTO `data_literature_dump` VALUES ('23', 'Œ≥\' PHASE INSTABILITIES IN HIGH REFRACTORY CONTENT Œ≥-Œ≥\' N\0-BASE SUPERALLOYS', 'Stoichko Antonov;Dieter Isheim;David N. Seidman;Eugene Sun;Randolph C. Helmink;Sammy Tin', '2016-12-15', 'Œ≥\' instability;Œ≥\' splitting;phase transformation;Œ≥ precipitates;coarsening;Ni-base alloy', 'Detailed electron microscopy and atom probe tomography (APT) techniques were used to systematically quantify the chemical and morphological instabilities that occur during aging of polycrystalline Ni-base superalloys containing elevated levels of refractory alloying additions. The morphological changes and splitting phenomenon associated with the secondary Œ≥\' precipitates were related to the discrete chemical compositions of the secondary and tertiary Œ≥\' along with the phase compositions of the Œ≥ matrix and the Œ≥ precipitates that form within the secondary Œ≥\' particles. Compositional phase inhomogeneities led to the precipitation of finely dispersed tertiary Œ≥\' particles within the Œ≥ matrix and secondary Œ≥ particles within the secondary Œ≥\' precipitates, which, along with surface grooving of the secondary Œ≥\' particles, contributed to the inverse coarsening or splitting of the precipitates during aging.', 'C', 'Illinois Institute of Technology;Department of Materials Science and Engineering;Northwestern University Center for Atom Probe Tomography (NUCAPT);Rolls-Royce Corporation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Œ≥\' Phase Instabilities in High Refractory Content Œ≥.\' Ni-Base Superalloys', '0', '0', '176');
INSERT INTO `data_literature_dump` VALUES ('24', 'DEVELOPMENT OF LOWORZERO-RHENIUM HIGH-PERFORMANCE NL-BASESINGLE CRYSTAL SUPERALLOYSFOR JET ENGINE AND POWER GENERATION APPLICATIONS', 'Kyoko Kawagishi; Tadaharu Yokokawa;Toshiharu Kobayashi; Yutaka Koizumi; Masao Sakamoto1;Michinari Yuyama; Hiroshi Harada; Ikuo Okada; Masaki Taneike;Hidetaka Oguma ', '2016-12-15', ' Single crystal, Creep; Corrosion resistance; Thermal mechanical fatigue.', 'Advanced superalloys with high levels of Re and Ru have difficulties with cost and having a stable supply for application in industry. Accordingly, 1.2 wt. %-Re alloy TMS-286 and Re-free alloy TMS-1700 have been developed for aero engine and power generation applications. These alloys showed well-balanced hot corrosion resistance, creep strength, and thermo-mechanical fatigue (TMF) life. An optimized content of Re, Si and Mo improve the hot corrosion resistance, oxidation resistance and TMF life, respectively, without degrading creep properties. ', 'C', '1 National Institute for Materials Science; 1-2-1 Sengen, Tsukuba, Ibaraki, 305-0047, Japan 2Mitsubishi Heavy Industries, Ltd.; 1-1 Shinhama, 2-chome, Arai-cho, Takasago, Hyogo, 676-8686, Japan', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of Low or Zero-Rhenium High-Performanc.pdf', '0', '0', '177');
INSERT INTO `data_literature_dump` VALUES ('25', 'DEVELOPMENT OF NEW SX SUPERALLOYS ‚Äì FAST EXPERIMENTAL FEEDBACK VERSUS THERMODYNAMIC MODELING', 'R. V√∂lkl; E. Fleischmann; R. Rettig; E. Affeldt;U. Glatzel ', '2016-12-15', ' Alloy development; Re effect;solid solution hardening; CALPHAD', 'A framework for accelerated alloy development of Ni-base superalloy single crystals is presented. It combines CALPHAD simulations with fast experimental feedback. The hardening efficiency of refractory elements at 980¬∞C was assessed within this framework. The creep strength of modern two phase superalloys is dependent to a high degree by the strength of the matrix phase. It is shown that the combination of computer simulations, i.e. the alloysby-design approach, with fast experimental feedback is crucial', 'C', '1Metals and Alloys, University Bayreuth, Germany 2Institute of Science and Technology of Metals, Friedrich-Alexander-University Erlangen-N√ºrnberg, Germany 3MTU Aero Engines GmbH, Munich, Germany', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of New SX Superalloys ‚Äì Fast Experimen.pdf', '0', '0', '178');
INSERT INTO `data_literature_dump` VALUES ('26', 'DEVELOPMENT OF THERMAL BARRIER COATING SYSTEM USING EQ COATING FOR ADVANCED SINGLE CRYSTAL SUPERALLOYS', 'Kazuhide Matsumoto; Kyoko Kawagishi; Hiroshi Harada ', '2016-12-15', ' Thermal barrier coating; Oxidation-resistant coating; Thermodynamically equilibrium ', '‚ÄúEQ coating‚Äù, which was developed for a new thermal barrier coating system and was named from ‚ÄúEquilibrium Coating‚Äù, is an oxidation-resistant coating using thermodynamically equilibrium state of the substrate and so it suppresses the interdiffusion between the substrate and coating layer. EQ coating and the ceramics top coat were applied to the 4th generation superalloy. EQ coating showed the excellent thermal barrier coating (TBC) life with the conventional yttria-stabilized zirconia (YSZ) system, and is able to be applied to the materials of the lower thermal conductivity. EQ coating was also applied to the 6th generation superalloy and its durability was evaluated.It is confirmed that the secondary reaction zone (SRZ) formation was suppressed and the interdiffusion at the interface was minimized, by cross section observation and concentration profile analysis.', 'C', 'National Institute for Materials Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of Thermal Barrier Coating System Usin.pdf', '0', '0', '179');
INSERT INTO `data_literature_dump` VALUES ('27', 'DISCUSSING THE EFFECT OF GAMMA PRIME COARSENING ON HIGH TEMPERATURE LOW STRESS CREEPDEFORMATION WITH RESPECT TO THE ROLE OF REFRACTORY ELEMENTS', 'T. Goehler; C. Schwalbe; J. Svoboda;E. Affeldt;R.F. Singer', '2016-12-15', ' Coarsening; Solid-solution hardening,JJ‚Äô-Thickness ratio; CALPHAD; Creep modelling ', 'Using the predictions made by a microstructure sensitive creep model for high-J‚Äô-containing superalloys, this study will compare the predictions made for the dislocation activity during different stages of the microstructural evolution against experimental results in order to understand the role and influence of microstructural coarsening. Furthermore a composition simulation was undertaken to present optimization potential with respect to microstructural coarsening properties. ', 'C', '1MTU Aero Engines AG, Dachauer Stra√üe 665, 80995 M√ºnchen, Germany 2Cambridge University, Department of Material Science and Metallurgy, CB3 0FS Cambridge, United Kingdom 3Academy of Sciences of the Czech Republic, Institute of Physics of Materials, 61662 Brno, Czech Republic 4University of Erlangen, Institute of Science and Technology of Metals, 91058 Erlangen, Germany', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Discussing the Effect of Gamma Prime Coarsening on.pdf', '0', '0', '180');
INSERT INTO `data_literature_dump` VALUES ('28', 'DEFORMAYION MECHANISMS AND MICROSTRUCTURAL EVOLUTION OF Œ≥+Œ≥\' DUPLEX AGGREGATES GENERATED DURINGTHERMOMECHANICAL PROCESSING OF NICKEL-BASE SUPERALLOYS', 'Beijiang Zhang;Guangpu Zhao;Wenyun Zhang;Guohua Xu;Heyong Qin', '2016-12-15', 'Hot working;Deformation mechanism;Superplasticity;Constitutive relationship; Microstructure', 'Deficiency in hot plasticity is a major limiting factor for the development of disc alloys with superior mechanical properties and temperature capabilities. The deformation behavior of a series of highly alloyed disc alloys with »ñ∆çYROXPHIUDFWLRQs from 26% to 63% was experimentally and analytically investigated in this work. Flow stress data and the as-deformed structures were obtained using isothermal compression tests in which the prior thermomechanical history of experimental alloys was also taken into consideration. The results reveal that the two structural categories, the »ñ∆ç dispersion and the »ñ+»ñ∆ç duplex, exhibit significant differences in deformation mechanisms. Among all of the experimental alloys, the stability of the »ñ»ñ∆çGXSOH[VWUXFWXUHV increases with the increasing concentration of »ñ∆ç-forming elements. The formation of the »ñ+»ñ∆ç duplex always results in a decrease in flow stress and a promotion of plasticity. In particular, the »ñ+»ñ∆ç duplex structures exhibit the ability to maintain superplasticity at a high strain rate up to 0.1 s-1. The distribution of strain rate sensitivity and activation energy in the relationships with temperature and strain rate accurately identifies a specific domain within which »ñ»ñ∆çGXSOH[H[KLELWVVXSHUSODVWLFLW\\Both the microstructural characterization and the mechanical interpretation confirm that the inherent characteristics of the »ñ»ñ∆ç duplex, including flow softening, plasticity promotion and highstrain-rate superplasticity, mainly originate from a strain-induced, high-velocity »ñ-»ñ∆çLQWHUIDFHUHDFWLRQPHFKDQLVP, which is similar to that of cellular reaction or eutectoid transformation. For the alloys with up to more than 60% of »ñ∆ç YROXPH IUDFWLRQ, by producing a »ñ»ñ∆çGXSOH[ using TMP, the hot working process, including billet conversion and microstructure customization, can be achieved in a cost-effective manner on an industrial scale.', 'C', '1High Temperature Materials Research Division, China Iron & Steel Research Institute Group, Beijing 100081, China 2Beijing Key Laboratory for Advanced High Temperature Materials, Beijing 100081, China\r\n1High Temperature Materials Research Division, China Iron & Steel Research Institute Group, Beijing 100081, China 2Beijing Key Laboratory for Advanced High Temperature Materials, Beijing 100081, China\r\n1High Temperature Materials Research Division, China Iron & Steel Research Institute Group, Beijing 100081, China 2Beijing Key Laboratory for Advanced High Temperature Materials, Beijing 100081, China', '0', '0', '', null, null, 'D:\\\\superlloy\\\\literature\\\\piki\\\\Deformation Mechanisms and Microstructural Evoluti.\' Duplex Aggregates Generated during Thermomechanical Processing of Ni~1.pdf', '0', '0', '181');
INSERT INTO `data_literature_dump` VALUES ('29', 'DESIGN2)NEXT GENERATION Ni-BASE SINGLE CRYSTAL SUPERALLOYS  CONTAINING Ir: TOWARDS 1150 ¬∫C TEMPERATURE CAPABILITY', 'T. Yokokawa;H. Harada; Y. Mori,;K. Kawagishi; Y. Koizumi;T. Kobayashi;M. Yuyama;S. Suzuki', '2016-12-15', ' single crystal;alloy design;Ir addition;creep ', ' Ni-base single crystal (SC) superalloys with superior mechanical properties are being developed to improve thermal efficiency of jet engines and land-based gas turbines. The benefit of Ir addition to Ni-base SC superalloys and possibilities to design next generation Ni-base SC superalloys containing Ir were investigated in this study. \r\n Five equations that predict the tensile creep rupture life at test conditions of 800 ¬∞C and 735 MPa, 900 ¬∞C and 392 MPa, 1000 ¬∞C and 245 MPa, 1100 ¬∞C and 137 MPa and 1150 ¬∞C and 137 MPa were obtained for Ni-base SC alloys, including Ir containing compositions, with excellent multi-correlation coefficients that range from 0.95 to 0.98. From the regression coefficients of these prediction equations, we successfully clarified the predominating creep strengthening factors in middle - higher temperature and middle - lower stress creep test regions.  Additions of Ir were not found to improve the creep strength of alloys, but were effective in suppressing the formation of topologically close packed (TCP) phases. \r\nThe development of next-generation SC superalloys containing Ir with excellent creep strength was possible by using an updated alloy design program at the National Institute for Materials Science (NIMS). The developed alloy shows an improvement in temperature capability of 20 ¬∞C in terms of creep rupture life over that of sixth-generation Ni-base SC superalloy TMS-238', 'C', '1) National Institute for Materials Science (NIMS); 1-2-1 Sengen, Tsukuba, Ibaraki, 305-0047, Japan 2) Waseda University, Department of Applied Mechanics and Aerospace Engineering; ', '0', '0', null, null, null, 'D:\\\\superlloy\\\\literature\\\\piki\\\\Design of Next Generation Ni-Base Single Crystal S.pdf', '0', '0', '182');
INSERT INTO `data_literature_dump` VALUES ('30', 'DETERMINATION OF ORIENTATION AND ALLOYING EFFECTS ON CREEP RESPONSE AND DEFORMATION MECHANISMS IN SINGLE CRYSTALS OF NL-BASE DISK SUPERALLOYS ', 'T.M. Smith;L.V. Duchao;T. Hanlon;A. Wessman;Y. Wang; M.J. Mills', '2016-12-15', ' Ni-based Superalloy;Compression Creep;STEM;Deformation Mechanisms;Dislocation Activity Diagram ', 'In this study, the effects of varying crystal orientation and composition on active deformation modes are explored for two different Ni-base disk alloys. Understanding these effects will allow for improved predictive modeling and consequently faster advancements in Ni-base alloy development. In order to investigate these effects, compression creep tests were conducted on [001] and [110] oriented single crystal specimens of the disk alloys ME3 and ME501, at different stress/temperature regimes. At 760 ¬∞C and below, a prominent creep anisotropy exists between the two orientations, with the [110] oriented samples exhibiting superior creep strength. At 815 ¬∞C, the creep anisotropy disappeared between the two orientations. Through bright field scanning transmission electron microscopy, it was determined that the existence of creep anisotropy is a result of differences in deformation modes between the different orientations and alloy compositions.  Results of phase field modeling in which the interaction of dislocations with realistic precipitate structures is also conducted to further advance predictive creep deformation models. Introduction ', 'C', '1 Center for Electron Microscopy and Analysis, The Ohio State University, Columbus, OH 43212, USA 2 Department of Materials Science and Engineering, The Ohio State University, Columbus, OH 43210, USA 3', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Determination of Orientation and Alloying Effects .pdf', '0', '0', '183');
INSERT INTO `data_literature_dump` VALUES ('31', 'DEVELOPMENT OF A LOW-COST THIRD GENERATION SINGLE CRYSTAL SUPERALLOY DD9', 'J.R. Li;S.Z. Liu;X.G. Wang;Z.X. Shi;J.Q. Zhao ', '2016-12-15', 'Third generation single crystal superalloy;DD9;Creep;Microstructure stability;Oxidation resistance ', 'Single crystal (SC) superalloys are widely used in the high pressure turbine section of aero gas turbine engines due to the unique combination of properties and performance, and alloy development has generally focused on increased temperature capability. A low-cost third generation single crystal superalloy, designated as DD9, has been developed for aeroengine turbine blade applications. DD9 alloy contains 4.5 wt. % rhenium (Re), which is about 75%, 83% and 90% of the Re contents in the third generation single crystal superalloys CMSX-10, Ren√© N6 and TMS-75. The alloy system employs relatively high additions of refractory elements (tungsten, molybdenum, tantalum, rhenium and niobium) with contents of about 21 wt. %.   DD9 alloy has an approximate 30 qC improvement of temperature capability relative to DD6 alloy, a Chinese second generation single crystal alloy with creep rupture properties that are comparable with PWA 1484, Ren√© N5 and CMSX-4. The tensile properties and creep rupture properties of DD9 alloy are comparable to those of the third generation single crystal alloys such as CMSX-10, Ren√© N6 and TMS-75. The advantage of DD9 alloy shown in the creep rupture properties over DD6 also generally holds for fatigue properties. DD9 alloy has good microstructure stability and heat treatment characteristics, and the alloy also provides superior oxidation resistance and hot corrosion resistance.   Casting trials have been conducted on DD9 involving a great number of bars, several different complex shaped hollow turbine blades and double wall cooling blades. It is shown that DD9 casting yields and grain structure are similar to the second generation single crystal superalloys. These trials demonstrate that DD9 alloy possesses excellent single crystal castability.', 'C', 'Science and Technology on Advanced High Temperature Structural Materials Laboratory, Beijing Institute of Aeronautical Materials', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of a Low-Cost Third Generation Single .pdf', '0', '0', '184');
INSERT INTO `data_literature_dump` VALUES ('32', 'DEVELOPMENT OF A LOW-DENSITY RHENIUM-FREE SINGLE CRYSTAL NICKEL-BASED SUPERALLOY BY APPLICATION OF NUMERICAL MULTI-CRITERIA OPTIMIZATION USING THERMODYNAMIC CALCULATIONS ', 'Ralf Rettig;Kamil Matuszewski;Alexander M√ºller;Harald E. Helmer;Nils C. Ritter;Robert F. Singer ', '2016-12-15', ' alloy design;multi-criteria global optimization;MultOPT;numerical methods;rhenium-free superalloy ', 'A computational alloy design method based on numerical multicriteria global optimization is presented (termed MultOPT). Its application is demonstrated by the design of a novel rhenium-free low-density superalloy called ERBO/15. This alloy has been produced and tested on a lab-scale and results on high temperature creep strength and microstructure are presented. Despite its low density of 8.4 g/cm¬≥ and despite the fact that it contains no Re, the creep strength of ERBO/15 is comparable to that of the rheniumcontaining alloy CMSX-4¬Æ 1. With our MultOPT approach, in order to identify promising compositions, large compositional spaces can be scanned and the full complexity of superalloys can be taken into consideration. It is ensured that from a mathematical point of view the best possible alloy for the given requirements is found. The alloy properties are predicted by thermodynamic CALPHAD-calculations and by an empirical model for creep strength in the high-temperature, low-stress regime: The creep strength is maximized by maximizing the weighted amount of solid solution strengthening elements in the matrix and maintaining an optimum morphology and fraction of the J\'-phase. The optimization algorithm uses Kriging surrogate models for higher performance. Additionally in order to prepare the future usage of more complex alloy property models in the optimization, an existing TCP-phase precipitation model is validated experimentally within the paper', 'C', 'University of Erlangen-Nuremberg, Institute for Science and Technology of Metals, Martensstr. 5, D-91058 Erlangen, Germany', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of a Low-Density Rhenium-Free Single C.pdf', '0', '0', '185');
INSERT INTO `data_literature_dump` VALUES ('33', 'DEVELOPMENT OF Ni-Cr-Fe-W-Al SUPERALLOY FOR ADVANCED ULTRA-SUPERCRITICAL FOSSIL POWER PLANTS', 'X.C. Hao;M.Q. Ou;T. Liang ;C. Xiong;Y.C. Ma;K. Liu ', '2016-12-15', ' A-USC;alloy design;Ni-base superalloy;mechanical property ', 'Significant efforts on development of advanced ultra-supercritical (A-USC) fossil fired power plants with steam conditions of 700 oC and 30 MPa or higher have been made in recent years. The most important consideration is the development of materials for components with working temperature as high as 750 oC. This paper presents (1) the design methodology that was used to define the composition of a Ni-Cr-Fe-W-Al superalloy, (2) microstructure-mechanical property relationship that were established in this work and (3) the results of elevated temperature tensile and stress-rupture testing that demonstrate the capacity of the alloy. Based on the thermodynamic calculation, a Ni-Cr-FeW-Al alloy, with the nominal composition of 20 Cr, 6 W, 1.0 Mo, 5 Fe, 1.2-2.3Al, 0.5-1.8 Ti, 1.0 Nb in wt. %, has been designed and selected for the experimental evaluation. It was found that increasing the carbon content (in wt.%) from 0.008 to 0.073 increases the total volume fraction of inter- and intra-granular carbides and modifies the intergranular carbide morphology from script-like and discrete to particle-like and semi-continuous. The carbon addition also improves the mechanical strength and the elongation at 750 oC. The stress-rupture properties show the best combination of rupture life and elongation in samples with carbon content 0.034 wt.%. Stress-rupture properties have been examined at 700-850 oC and the results in a Larson-Miller plot show that NiCr-Fe-W-Al alloy exhibits stress-rupture strength of about 220 MPa for 700 oC/105 h and 112 MPa for 750 oC/10 5h which is satisfied for the application of superheater/reheater tubing. ', 'C', 'Institute of Metals Research, Chinese Academy of Sciences', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of Ni-Cr-Fe-W-Al Superalloy for Advanc.pdf', '0', '0', '186');
INSERT INTO `data_literature_dump` VALUES ('34', 'DISLOCATIONS NUCLEATION AND INTERACTION WITH GRAIN BOUNDARIES IN A POLYCRYSTALLINE NICKEL BASE SUPERALLOY', 'O.M.D.M. Mess¬¥e;C.M.F. Rae', '2016-12-15', ' Nickel-based superalloy; deformation;grain boundaries;dislocations;TEM;RR1000', 'Dislocation interaction with grain boundaries is a compelling problem as it inÔ¨Çuences mechanical properties, of which tensile and fatigue behavior are the most prominent. Detailed assessment of such interactions at speciÔ¨Åc boundaries in single phase materials has led to the establishment of a slip transfer criteria. However, nickel base superalloy microstructure is more complex especially in the area surrounding of grain boundaries where, with an appropriate supersolvus heat-treatment, highly serrated boundaries develop, also exhibiting large Œ≥ precipitates abutting the boundary. Dislocation behavior at grain boundaries is reported in an interrupted tensile test performed at 700‚ó¶C in a polycrystalline nickel base superalloy exhibiting a coarse grain microstructure and a bimodal distribution of Œ≥ precipitates. Dislocation interaction has been assessed at three diÔ¨Äerent types of boundaries: (i) a twin boundary, (ii) a highly serrated high angle grain boundary and (iii) a faceted high angle grain boundary.', 'C', 'Rolls-Royce UTC, Department of Materials Science & Metallurgy, University of Cambridge, 27 Charles Babbage Road, Cambridge CB3 0FS, UK', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Dislocations Nucleation and Interaction with Grain.pdf', '0', '0', '187');
INSERT INTO `data_literature_dump` VALUES ('35', 'EFFECT OF BOND COAT AND SUBSTRATE CHEMISTRY ON THE INTERFACIAL DEGRADATION OF THERMAL BARRIER COATINGS', 'L.T. Wu;R.T. Wu;T. Osada;K.I. Lee;M. Bai;P. Xiao', '2016-12-15', 'Thermal barrier coatings;Phase transformation;Interface', 'Despite the benefit of increased operating temperature of turbine blades, the application of thermal barrier coatings (TBC) has brought the concern of coating spallation during jet engine operations. A significant portion of past research, was therefore, devoted to detailed analysis of theinterfacial degradation behavior of TBC by numerical and analytical models. Nonetheless, these models tend to overlook the influence of the degradation on the complicated nature of substrate chemical diffusion/phase transformation. As a result, the predicted TBC lifetime expressed in terms of failure criterion (i.e. thermally grown oxide thickness) often deviate largely from that obtained by real experiment. The purpose of this research work is to clarify the role of substrate chemistry on the interfacial degradation of TBC. Extensive analysis was carried out on a set of systematically prepared commercial TBC subjected to different thermal exposure times. The results clearly indicated that the interfacial adhesion is a dynamic property, which depends on the substrate chemical diffusion/phase transformation. It became evident that the early spallation observed in several E bond coat system was caused by two unique phase transformations. Furthermore, the phase transformation was shown to be closely associated with the inherent chemistry of the substrate.', 'C', '1National Institute for Materials Science, Tsukuba,305-0047Japan 2School of Materials, The University of Manchester, Manchester M1 7HS, UK', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Bond Coat and Substrate Chemistry on the.pdf', '0', '0', '188');
INSERT INTO `data_literature_dump` VALUES ('36', 'EFFECT OF HEAT TREATMENTS ON THE MICROSTRUCTURE AND TEXTURE OF CM247LC PROCESSED BY SELECTIVE LASER MELTING', 'R. Mu√±oz-Moreno;V. D. Divya;O. M. D. M. Mess√©;T. Illston; S. Baker;H. J. Stone', '2016-12-15', ' CM247LC; Selective Laser Melting; heat treatments; microstructure; microtexture ', 'Selective laser melting (SLM) has the potential of producing components with complex geometries that cannot be fabricated with conventional manufacturing methods. This capability is receiving particular attention from the aerospace industry as it may allow high temperature structural components to be created with advanced cooling channel configurations. This would enable future gas turbines to run hotter and thereby achieve improved efficiencies. However, an improved understanding of the effect of SLM on alloy microstructures is required if they are to realise this potential. In the present study, the microstructure and texture of the nickel-based superalloy CM247LC¬Æ in the as-SLM and subsequently heat-treated states have been characterised. The asSLM material was observed to have a cellular microstructure composed of fine elongated cells with a preferential alignment of <001> along the build direction and a significant intercellular misorientation. Heat treatments below and in the vicinity of the  π solvus resulted in a recovered microstructure, whilst a fully recrystallised microstructure was observed following heat treatment at 1240 ¬∞C and above. The effect of the heat treatment temperature on the nucleation and growth of both the  π precipitates and the carbides was also determined.', 'M', 'Department of Materials Science and Metallurgy, University of Cambridge, 27 Charles Babbage Road, Cambridge CB3 0FS, UK 2Materials Solutions, Unit 8, Great Western Business Park, McKenzie Way, Worcester, WR4 9GN, UK', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Heat Treatments on the Microstructure an.pdf', '0', '0', '189');
INSERT INTO `data_literature_dump` VALUES ('37', 'EFFECT OF INGOT SIZE ON MICROSTRUCTURE AND PROPERTIES OF THE NEW ADVANCED AD730TM SUPERALLOY ', 'C.Crozet; A. Devaux; R. Forestier; S.Charmond; M.Hueller; D.Helm; W. Buchmann', '2016-12-15', 'AD730TM;U720Li;Ingot size;Microstructure;Mechanical properties ', 'The enhancement of efficiency in gas turbine engines requires the development of new superalloys capable of withstanding higher temperatures. The development of new industrial cast and wrought (C&W) disk alloys with required combination of strength, creep and fatigue properties at 700 ¬∞C is highly desired due to expensive cost of powder metallurgy. The development of U720Li in the nineties provided an intermediate solution in term of cost / properties combination between 718 and powder metallurgy superalloys. However, U720Li is known to be difficult to be manufactured due to its high Œ≥\' content (45%) and can be considered as the limit between C&W route and powder metallurgy route. Because of this and its intrinsic raw material content, U720Li is significantly more expensive than alloy IN718.  To remain competitive on worldwide aeronautical market, engine designers are more and more challenged to optimize cost/properties combination of each component. In this context, Aubert&Duval has developed a new C&W superalloy, AD730TM, which was designed to offer a better combination between high temperature properties at 700 ¬∞C and cost compared to U720Li. The lower content of Ti and the lower Œ≥\' amount in AD730TM compared to U720Li is expected to reduce the segregation tendency. Contrary to U720Li, the better ability of AD730TM for C&W route enables the vacuum arc remelting of larger ingots up to 635 mm diameter, which is expected to have a beneficial impact on billet cost. This paper describes the work performed within the European Cleansky project CESAME (Cost Effective Superalloy for Advanced Modern Engine) which evaluated the feasibility of larger AD730TM ingots (635 mm diameter ingots) in order to improve AD730TM manufacturing cost. Comparisons between AD730TM ingot of 635 mm diameter (called in the following text AD730TM large ingot), AD730TM ingot of 508 mm diameter (called in the following text AD730TM small ingot) and U720Li ingot of 508 mm diameter (called in the following text U720Li ingot) were performed after conversion to billets of 254 mm but also on close-die forged disks. Results on billets showed that increasing ingot size for AD730TM alloy had a beneficial impact on billet microstructure and ultrasonic testing results in comparison with AD730TM and U720Li smaller ingots (508 mm diameter). Increasing AD730TM ingot diameter up to 635 mm was not harmful on chemical homogeneity but led as expected to an increase of carbonitrides size. Tensile, creep and fatigue tests on close-die forged disks showed no detrimental influence of AD730TM larger ingot size (635 mm diameter) compared to AD730TM smaller ingot (508 mm diameter). However, homogeneous microstructure and better UT detectability than those on U720Li disks were obtained on AD730TM disks. Mechanical properties of AD730TM and U720Li are very similar with advantages on tensile strength at high temperature and creep  elongation for AD730TM. Finally, fatigue tests on close-die forged disks showed that the largest carbonitrides observed on disk from AD730TM large ingot did not lead to detrimental effect on fatigue properties. This work was a reliable demonstration of AD730TM larger ingot feasibility to enhance the combination between cost and properties', 'C', '1 Aubert&Duval, Site des Ancizes BP1, 63770 Les Ancizes Cedex, France 2 Aubert&Duval, Site de Pamiers, 75 bd de la Lib√©ration, 09102 Pamiers Cedex, France 3MTU Aero Engines, Dachauer Str. 665, 80995 Munich, Germany', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Ingot Size on Microstructure and Propert.pdf', '0', '0', '190');
INSERT INTO `data_literature_dump` VALUES ('38', 'EFFECT OF LARGE PLASTIC STRAINS AND STRAIN GRADIENTS ON RESIDUAL STRESS RELAXATION IN SHOT PEENED IN100 ', 'Dennis J. Buchanan;Reji John ', '2016-12-15', 'shot peening;residual stress;modeling;Ni base superalloy;IN100 ', 'Surface treatment processes, such as shot peening, are routinely used by several manufacturing industries (automotive, aerospace, medical, etc.) to impart compressive residual stresses onto the surface of metal components to increase damage tolerance and fatigue life.  These compressive stresses are engineered into components to delay initiation of surface cracks and retard crack growth rate thereby improving fatigue life.  In addition, the plastic deformation resulting from the shot peening process hardens the material increasing the yield strength and elastic stress range.  For elastic material response, accurate fatigue life estimates that include credit for residual stresses are possible for complex geometries with complicated load histories.  However, when a shot peened component is subjected to elevated temperatures or cyclic loading, thermal relaxation and cyclic plasticity, respectively, produce inelastic material response from which residual stresses may change continuously.  When the material response is inelastic, taking full credit for compressive residual stresses in fatigue models would result in a nonconservative prediction.  As a result, designers are reluctant to incorporate any compressive residual stresses into fatigue life predictions of turbine engine components, subject to elevated temperatures and inelastic loading conditions.  This paper investigates relaxation of shot peened residual stresses in IN100 when subjected to applied stress profiles that produce large plastic strains and strain gradients in laboratory test samples. Model predictions supported by experiments results are presented to explain that redistribution of residual stress depth profiles are a function of geometry and applied stress/strain profile', 'C', '1Materials and Manufacturing Directorate Air Force Research Laboratory (AFRL/RXCM) Wright-Patterson AFB, OH 45433-7817 2University of Dayton Research Institute', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Large Plastic Strains and Strain Gradien.pdf', '0', '0', '191');
INSERT INTO `data_literature_dump` VALUES ('39', 'EFFECTOFNON-METALLICCERAMICINCLUSIONSONSTRAINLOCALIZATIONDURING LOWCYCLEFATIGUEOFAPOLYCRYSTALLINESUPERALLOY ', 'Jean-Charles Stinville;Victoria M. Miller;Tresa M. Pollock ', '2016-12-15', ' High Resolution Scanning Electron Microscope Digital Image Correlation; Ren¬¥e 88DT Nickel-Base Superalloy;Low Cycle Fatigue; Nonmetallic Ceramic Inclusion ', 'The presence of inclusions in powder metallurgical processed disk materials often leads to competing failure modes and a wide variability in fatigue durability in low cycle fatigue. For robust models for fatigue and prediction of the variability in this property, the impact of such inclusions on the fatigue crack initiation process has been studied. Fatigue experiments in the low cycle fatigue regime on an intentionally seeded Ren¬¥ e 88DT polycrystalline nickel-base superalloy were performed at 400 ‚ó¶C and 650 ‚ó¶C to evaluate the effect of non-metallic ceramic inclusions on the strain distribution and fatigue initiation process. Advanced high resolution digital image correlation measurements were performed to related strain Ô¨Åelds at the grain scale to microstructure surrounding non-metallic inclusions.', 'M', 'Materials Department; University of California, Santa Barbara; Santa Barbara, CA 93106', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Non-Metallic Ceramic Inclusions on Strai.pdf', '0', '0', '192');
INSERT INTO `data_literature_dump` VALUES ('40', 'EFFECT OF Re AND Ta ON HOT CORROSION RESISTANCE OF NICKEL-BASE SINGLE CRYSTAL SUPERALLOYS ', 'J.X. Chang; D. Wang; G. Zhang; L.H. Lou; J. Zhang ', '2016-12-15', ' Hot Corrosion; Molten Salts; Rhenium; Tantalum; Sulfidation ', 'Hot corrosion behavior of several Ni-base single crystal (SX) superalloys with different Re, Ta and Cr contents at 750 oC and 900 oC in static air has been systematically investigated using the ‚Äúdeposit recoat‚Äù method. It was shown that, both Re and Ta can improve the hot corrosion resistance of SX superalloys. Re may alter the activities of elements and therefore delay the deformation and cracking of oxide scale, and may enable the self-healing of the oxide scale. The advantage to hot corrosion properties of adding Ta depends on Cr content in the superalloys. The beneficial effect of Ta is more pronounced in alloys with a low Cr content. Ta was found to exhibit a beneficial effect by promoting the formation of NaTaO3 and TaS2, and therefore inhibiting the formation of liquid Na2MoO4 and Ni-sulfides. It seems that Re and Ta are promising elements that allow us to design hot corrosion resistant superalloys with superior high temperature properties. ', 'C', 'Superalloys Division, Institute of Metal Research, Chinese Academy of Sciences, 72 Wenhua Road, Shenyang 110016, China', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Re and Ta on Hot Corrosion Resistance of.pdf', '0', '0', '193');
INSERT INTO `data_literature_dump` VALUES ('41', 'EFFECT OF REJUVENATION HEAT TREATMENT AND AGING ON THE MICROSTRUCTURAL EVOLUTION IN RENE N5 SINGLE CRYSTAL Ni BASE SUPERALLOY BLADES', 'Joydeep Pala;Dheepa Srinivasana;Eric Chengb', '2016-12-15', 'N5;Single Crystal; Gamma prime (Œ≥‚Äô); TCP phases; Rejuvenation heat treatment;recrystallization', 'Rejuvenation heat treatment is often given to Ni base superalloy components that have come back from service, to restore the material microstructure and mechanical properties, to enable it to function as good as new for another interval of service operation [1-4]. In this case, the heat treatment is designed to restore a severely overaged precipitate microstructure of the N5 single crystal blade to that of the original as cast structure having cuboidal Jc precipitates. However, during service operation, there are other minor phases that precipitate over a period of time out of the Ni (solid solution) matrix, such as the TCP phases (topologically close packed) such as Œ∑, œÉ, Œº, comprising primarily a combination of one or more of the heavy elements, Re, Mo, W etc. [5-7]. The occurrence of these phases, which are typically brittle, may deteriorate the mechanical properties of the component. During rejuvenation heat treatment these phases may or may not dissolve into the J (Ni base) matrix, unlike the Jc phase. The evolution after 4000 cycles and on the single crystal Rene N5 (SX) alloy microstructure has been studied with emphasis on the precipitation of these minor phases. The thermal stability of the rejuvenated microstructure to long term service exposure is analyzed via aging. In addition after a rejuvenation heat treatment, the single crystal may undergo recrystallization in certain locations, where the component has undergone machining. This study brings out the salient features of the microstructural evolution of a rejuvenation heat treatment and subsequent aging, towards practical usage of the single crystal N5 superalloy', 'M', 'aGE Power, GE India Technology Centre, Bangalore ‚Äì 560066, India bGE Aviation Service Operation Private Limited, 23 Loyang Way, Singapore ‚Äì 508726', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Rejuvenation Heat Treatment and Aging on.pdf', '0', '0', '194');
INSERT INTO `data_literature_dump` VALUES ('42', 'EFFECTS OF OXIDATION ON FATIGUE CRACK INITIATION AND PROPAGATION IN AN ADVANCED DISK ALLOY ', 'R. Jiang, N. Gao; M. Ward, Z. Aslam; J. C. Walker; P. A. S. Reed ', '2016-12-15', ' Ni-based superalloy; grain boundary oxidation; fatigue crack; intergranular fracture ', ' Understanding the fatigue performance of aeroengine disk alloys is important for both alloy development and life prediction of disk components. In this study, fatigue crack initiation and propagation in coarse grained (CG) and fine grained (FG) Low Solvus, High Refractory (LSHR) alloy developed for disk applications have been assessed at 650 and 725 oC by carrying out three-point bend tests in air and vacuum under a 1-1-1-1 trapezoidal waveform in combination with a surface replication procedure. Optical microscopy, scanning electron microscopy, focussed ion beam (FIB), transmission electron microscopy (TEM) and energy dispersive X-ray (EDX) spectroscopy have been employed to reveal the underlying mechanisms of fatigue crack initiation and early propagation under these fatigueoxidation conditions. The results show that FG LSHR possesses a better fatigue life although it exhibits more severe grain boundary oxidation as indicated by more intergranular fracture surfaces. Cracks mainly initiate from bulged grain boundary oxides which consist of outermost Co-rich and Ni-rich oxide complex at the surface and underneath Cr/Ti/Al oxide intrusions along the grain boundaries. Once initiated, cracks propagate mostly by the coalescence of neighboring grain boundary cracks as observed on the replicas, especially in the FG variant. Formation of these grain boundary oxides is closely related to the applied stress and the strain localization at the grain boundary, and is accompanied by  ﬁâ»ñ dissolution. The distribution of oxides examined by TEM-EDX suggests fatigue failure processes involve repeated cycles of oxide formation ƒ∫oxide cracking ƒ∫oxide formation at the crack tip ƒ∫oxide cracking at the crack tip', 'M', '1Engineering Materials Research Group, Faculty of Engineering and Environments, University of Southampton, Southampton, SO17 1BJ, UK 2 Institute for Materials Research, School of Chemical and Process Engineering, University of Leeds, Leeds, LS2 9JT, UK', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effects of Oxidation on Fatigue Crack Initiation a.pdf', '0', '0', '195');
INSERT INTO `data_literature_dump` VALUES ('43', 'EFFECTS OF SEA SALT ON THE OXIDATION OF CMSX-4¬Æ AT 1100 ¬∞C', 'H.T. Pang;F. Li; S. Pahlavanyali; I.M. Edmonds; G. Brewster; C.M.F. Rae', '2016-12-15', 'Superalloy;Sea salt; Cyclic oxidation; Hot corrosion; Thermogravimetric analysis ', 'Recently, a new High Temperature Environmental Testing (HTET) methodology has been described which combines cyclic oxidation with the addition of synthetic sea salt. The current investigation aims to further understand the effects of synthetic sea salt deposition on the oxidation behavior of a secondgeneration nickel-base single-crystal superalloy CMSX-4¬ì. A series of isothermal and cyclic oxidation tests at 1100 ¬∞C were carried out on bare and salt-deposited samples. The effects of different salts and altered salt application regimes on cyclic oxidation at 1100 ¬∞C were also evaluated. Further experiments were carried out using thermo-gravimetric analysis (TGA) to study the cyclic oxidation process in greater detail for both the bare and sea salt-deposited samples. During both isothermal and cyclic oxidation, synthetic sea salt deposition generally resulted in enhanced oxidation attack compared to the bare sample. Prior oxidation to produce a stable coherent protective alumina coating loses its protective capability as soon as salt is added. Conversely, after being subjected to cyclic oxidation with salt deposition, poorer oxidation resistance was noted in subsequent cyclic oxidation without salt deposition. Cyclic oxidation investigated with TGA shows that with salt deposition, significant oxidation attack occurs within the first few cycles, after which a steady-state oxide regeneration and spallation regime was progressively attained. The effects of salt on high temperature oxidation, even at the low dosages used in the current study, are clearly critical and have lasting effects on the oxidation resistance performance on the test samples as well as components made of similar alloys; these are discussed in light of the results obtained', 'M', '1Dept. of Materials Science and Metallurgy, University of Cambridge, 27 Charles Babbage Road, Cambridge CB3 0FS, U.K. *now at Singapore Institute of Manufacturing Technology, 73 Nanyang Drive, Singapore 638075, Singapore. 2ERA Technology Ltd., Cleeve Road, Leatherhead KT22 7SA, U.K. 3Rolls-Royce plc., P.O. Box 2000,Raynesway, Derby DE21 7XX, U.K', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effects of Sea Salt on the Oxidation of CMSX-4¬Æ at.pdf', '0', '0', '196');
INSERT INTO `data_literature_dump` VALUES ('44', 'EVALUATION OF AD730TM FOR HIGH TEMPERATURE FASTENER APPLICATIONS ', 'A. Devaux; W. Li; C. Crozet; J.M. Lardon', '2016-12-15', ' AD730TM; fastener; notch sensitivity; heat-treatment; aging; cooling rate ', 'AD730TM, which is a new nickel base superalloy developed by Aubert & Duval, was designed to provide a better combination of higher temperature strength and cost than the currently available wrought superalloys. In comparison with U720Li, which can be considered as one of the most efficient cast & wrought (C&W) superalloy, previous studies have shown that the mechanical properties of AD730TM are equivalent but its formability for the C&W route is much better. This alloy has also been considered for high temperature fastener applications thanks to its high mechanical properties up to 750 ¬∞C and its good workability. In this study bars with diameters in the 1527mm diameter range were successfully hot rolled to enable the evaluation of AD730TM for fastener applications. Preliminary tests show that AD730TM, heat-treated in standard conditions with an average grain size equal to ASTM 10, was notch sensitive above 700 ¬∞C in the presence of stress concentration factor higher than 4. Heat-treatment of AD730TM was investigated and optimized for fasteners applications against notch sensitivity and balanced tensile, creep and fatigue properties. Results show that creep notch sensitivity can be mitigated by increasing the aging temperature, decreasing the cooling rate after solution heat-treatment or decreasing the solution heat-treatment temperature. The best notch fatigue properties were obtained with the largest gamma prime precipitates which promote stress relaxation at the notch. The implication of these findings is that the material properties of AD730TM can be customized via specific heat treatment to suit different requirements in fastener applications.', 'C', '1Aubert & Duval, Site des Ancizes BP1, 63770 Les Ancizes Cedex, France 2Rolls-Royce plc., PO Box 31, Moor Lane, Derby DE24 8BJ, UK', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Evaluation of AD730‚Ñ¢ for High Temperature Fastener.pdf', '0', '0', '197');
INSERT INTO `data_literature_dump` VALUES ('45', 'EXPERIMENTAL STUDY OF THE BINARY NL-RX-SYSTEM USING DIFFUSION COUPLES MANUFACTURED BY ENCAPSULATING CAST ', 'Robert Popp; Rainer V√∂lkl; Thomas G√∂hler;Uwe Glatzel ', '2016-12-15', ' nickel; ruthenium; diffusion couples; solubility limits ', 'A novel preparation technique for diffusion couples as well as diffusion multiples has been developed. The approach suitable for phase diagram mapping and the investigation of diffusivities is based on a two-step casting process using a vacuum induction furnace to assemble diffusion samples encapsulated by nickel. The binary Ni-Ru-system was chosen as a first case study and two equal diffusion couples containing the pure components were prepared. Isothermal annealing at temperatures of 900 ¬∞C and 1100 ¬∞C generated constant interdiffusion zones throughout the contact surfaces of the pure elements. As validation of the new method, the results of the determined solubility limits in both phases are compared to previously published data and are found to be in very good agreement. ', 'C', '1Metals and Alloys, University of Bayreuth, Ludwig-Thoma-Str. 36b, 95447 Bayreuth, Germany 2MTU Aero Engines AG, Dachauer Str. 665, 80995 Munich, Germany', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Experimental Study of the Binary Ni-Ru-System Usin.pdf', '0', '0', '198');
INSERT INTO `data_literature_dump` VALUES ('46', 'FACTORS AFFECTING TBC FURNACE CYCLE LIFETIME: TEMPERATURE, ENVIRONMENT, STRUCTURE AND COMPOSITION', 'B. A. Pint; J. A. Haynes; M. J. Lance; H. L. Aldridge; Jr.; V. Viswanathan; G. Dwivedi;S. Sampath', '2016-12-15', 'Thermal barrier coatings; HVOF; oxidation resistance; water vapor; composition effects', 'Higher efficiency power generation turbines will benefit both natural gas-fired combined cycle units as well as coal gasification plants burning synthesis gas.  Increasing efficiency is primarily linked to the turbine inlet temperature, where increases require improved materials such as a higher performance thermal barrier coating (TBC) with the durability needed by utility customers.  An ongoing collaboration between Oak Ridge National Laboratory (ORNL) and the Center for Thermal Spray Research (CTSR) is combining expertise in processing and high temperature oxidation to understand relevant degradation mechanisms and identify promising concepts for further development.  Screening of new TBC concepts in the laboratory typically involves furnace cycle testing (FCT) and this technique has been used to explore variables such as temperature, environment, roughness, structure and composition.  For base load power generation duty, the traditional 1-h thermal cycle has been replaced in some experiments by 24- or 100-h cycles, which has focused attention on the limitations of FCT.  In order to link FCT results with observed long field TBC lifetimes in land-based turbines operating with ~900¬∞C metal temperatures, specimens were exposed in FCT at 900¬∞C and Al loss after 5-20 kh exposures has been used to make initial lifetime predictions.  Based on the observed FCT performance of flat coupons, the most recent work has explored cylindrical specimens.', 'C', '1Oak Ridge National Laboratory, Materials Science and Technology Division, Oak Ridge, TN  37831-6156  USA 2Center for Thermal Spray Research, Stony Brook University, Stony Brook, NY', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Factors Affecting TBC Furnace Cycle Lifetime_ Temp.pdf', '0', '0', '199');
INSERT INTO `data_literature_dump` VALUES ('47', 'Developing Processing Parameters for Nickel-base Supcralloys for the Electron Beam Melting Additive Manufacturing Process', 'Francisco Medina; Michael Kirka: Ulf Ackclid; Ryan Dchoff', '2016-12-15', 'Additive Manufacturing; Electron Beam Melting; Heat-treatment;Tensile Properties', 'A methodology was established to assist in the development of process parameters for nickel-base superalloys in the electron beam melting (EBM) process. The methodology was demonstrated on the Ni-base superalloy Alloy 718. The methodology includes characterization of the feedstock material, material parameter development, and build sample analysis. All steps were completed in order to understand the materiars behavior in the EBM system and to produce defect free parts. Extensive research has been done on Alloy 718 has been characterized and used in an Arcam A2X system. Build themes have been developed to produce components with mechanical properties meeting the AMS 5662 and ASTM F3055-14a testing requirements.', 'M', '‚ñ†Edison Welding Institute; Buffalo, NY, 14203 2Materials Science and Technology Division. Oak Ridge National Laboratory; Oak Ridge, TN, 37831, USA -\'Manufacturing Demonstration Facility, Oak Ridge National Laboratory; Knoxville, TN, 37932, USA 4Arcam AB, Molndal, Sweden', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Developing Processing Parameters for Nickel-Base S.pdf', '0', '0', '200');
INSERT INTO `data_literature_dump` VALUES ('48', 'DEVELOPMENT OF NICKEL-COBALT BASE P/M SUPERALLOYS FOR DISK APPLICATIONS', 'Y. F. Gu; T. Osada; T. Yokokawa; H. Harada;J. Fujioka', '2016-12-15', 'Ni-Co base superalloy; Disk; Powder metallurgy; Mechanical property', 'A new generation of powder metallurgy (P/M) Ni-Co-base superalloys has been developed to allow rim temperatures in turbine disk beyond 700 ¬∞C. In a series of the alloys designed, nickel was substituted by cobalt in various proportions in some commercial Ni-base disk superalloys and cobalt content was ranging from 25 to 29 wt.%. Hot isostatic pressing (HIP) bars of new design alloys were manufactured for microstmcturc and property evaluation. Results from the mechanical properties asvsessmenl indicate that some new design alloys have at least 69 ¬∞C temperature advantage in 0.2%-strain creep performance, higher tensile strength, comparable low-cycle fatigue (LCF) life, phase stability and oxidation resistance compared with P/M alloy 720Li.', 'C', '1	National Institute for Materials Science (NIMS); 1-2-1 Sengen, Tsukuba-shi, Ibaraki, 305-0047 Japan 2	Honda R&D Co., Ltd. Aircraft Engine R&D Center; 1-4-1 Chuo, Wako-shi, Saitama, 351-0193 Japan', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Development of Nickel-Cobalt Base P_M Superalloys .pdf', '0', '0', '201');
INSERT INTO `data_literature_dump` VALUES ('49', 'EFFECT OF Hf AND B ON TRANSVERSE AND LONGITUDINAL CREEP OF A Re-CONTAINING NICKEL-BASE BICRYSTAL SUPERALLOY', 'Y.S. Zhao; J. Zhang; Y.S. Luo; G. Sha; D.Z. Tang; Q. Feng', '2016-12-15', 'DD11 supera;;oy;Hf;B;grain boundaries;segregation behavior;creep properties', 'Hf and B have been added into single costal superalloys as micro-alloying elements to strengthen low angle grain boundaries. However, systematic investigations and quantitative characterizations of the microstructural evolution of grain boundaries in superalloys with different Hf and B additions are little reported. In this study, a double-seed solidification technique was used to produce nickel-base DD11 superalloy with two levels of misorientation (5¬∞ and 20¬∞). A detailed characterization of the misorientation related microstructures at the grain boundary (GB) in three bicrystal superalloys has been carried out; and the elemental distribution at the GB has been analyzed by using Auger electron spectroscopy (AES), time of flight secondary ion mass spectrometry (TOF SIMS) and atom probe tomography (APT) techniques. It was found that the bicr>:stals integrated well with each other althoughÔºõ in all three alloys, an almost continuous thin layer with bright contrast was seen at the low angle grain boundary (LAB). Cellular recrystallization microstructures along the high angle grain boundan* (HAB) were found in the Hf and B free alloy, but they were significantly suppressed with the addition of either Hf or a joint addition of Hf and B. There was no obvious segregation of Hf. but the segregation of B to HAB was clearly identified by all the analyses using TOF SIMS, AES and APT. The creep properties were closely related to that of the matrix in alloys witii LAB, but they were influenced remarkably by secondary precipitates and GB segregation in alloys with HAB. The additions of Hf and B together improved the trans\\erse and longitudinal creep rupture lives in the alloy with HAB significantly under the conditions of 1100 ¬∞C/130 MPa; 980 ¬∞C/250 MPa and 760 ¬∞C/785 MPa. This study is helpfUl to better understand the role of Hf and B in strengthening GB and to optimize Hf and B additions in DD11 superalloy', 'M', '1.	State Key Laboratoty for Advanced Metals and Materials, University of Science and Technology Beijing, Beijing 100083, China 2.	Science and Technology on Advanced High Temperature Structural Materials Laboratory*, Beijing Institute of Aeronautical Materials, Beijing 100095, China 3.	Herbert Gleiter Institute of Nanoscience, Nanjing University of Science and Technology. Nanjing 210094, China', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effect of Hf and B on Transverse and Longitudinal .pdf', '0', '0', '202');
INSERT INTO `data_literature_dump` VALUES ('50', 'EFFECTS OF Si ADDITION ON THE HIGH TEMPERATURE STRENGTH AND OXIDATION BEHAVIOR OF /-BEARING Co-BASED SUPERALLOYS', 'An-Chou Yeh; I-Ting Ho; Sheng-Chi Wang;Chia-Fu Cheng', '2016-12-15', 'Co-based superalloys; silicon addition;high temperature hardness; high temperature oxidation', 'This article aims to present the effect of Si addition on the microstructure, elemental partitioning, high temperature hardness, and oxidation behavior for /-bearing Co-based superalloy. The fraction of 7, phase can be increased with the addition of SiÔºå rendering an improvement on hardness at elevated temperatures. Furthermore. Si partitions preferentially toward r{ phase and affects partitioning behavior of W. Isothermal oxidation tests conducted at 900 ¬∞C, 1000 ¬∞CS and 1150 ¬∞C have indicated that Si additions can improve oxidation resistance. Furthermore, the content of W can have a profound impact on the oxidation behavior; low content of W can reder the formation of protective AI2O3 at temperatures at and above 1000 ¬∞C, while high W content can slow down oxidation at 900 ¬∞C.', 'M', 'Department of Materials Science and Engineering. National Tsing Hua University. Hsinchu. 30013. Taiwan R.O.C.', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Effects of Si Addition on the High Temperature Str.\'-Bearing Co-Based Superalloys.pdf', '0', '0', '203');
INSERT INTO `data_literature_dump` VALUES ('51', 'EVALUTION OF TEMPERTURE AND STRESS IN FIRST STAGE HIGH PRESSURE TURBINE BLADS OF A DIRECTIONALLY-SOLIDIFIED SUPERALLOY DZ125 AFTER SERVICE IN AEROENGINES', 'Y.D.Chen;Y.R.Zheng;C.B.Xiao;Q.Feng', '2016-12-15', 'DZ125 superalloy;temperture,stress,microstructural degradation;quantitative characterization;rafting', 'To get the actual service temperature and stress distribution of turbine blades is very important for the design and maintenance in aeroengines.However,the measurement of temperature and stress in serviced blades has always benn a challenge.It is necessary to develop an evaluation method based on the microstructual degradation of turbine blades.In the study,the microstructure of three turbine blades made of DZ125 alloy,which have been serviced for different service cycles,was investigated.The dissolution and rafting extent of Œ≥\' precipitates were quantitatively characterized by using the volume fraction and rafting degree,respectively.The results show that the extent of microstructural degradation varies with the service time and location of three turbine blades.The Vf values decreased gradually and Œ© values raised gradually in a certain location of turbine blades with the increase of service time.According to the service simulation experiments of DZ125 siperalloy,the quantitative and approximate monotonic relationship was established among temperature stress,Vf and Œ©.The service temperature and stress of turbine blades have been evaluated by the above relationship.This study is helpful to understand the effect of service temperature and stress on microstructual degradation of directionally-solidified turbine blades,and probes for a new way to evaluate temperature and stress.', 'C', 'State Key Laboratory for Advanced Metals and MAterials', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Evaluation of Temperature and Stress in First Stag.pdf', '0', '0', '204');
INSERT INTO `data_literature_dump` VALUES ('52', 'FATIGUE CRACK GROWTH RATE ASSESSMENT OF SUPERALLOYS BY THE EBSD METHOD', 'D. Kobayashi;T. Takeuchi;M. Achiwa', '2016-12-15', 'Ni-based superalloy;EBSD;Crack growth rate;Low cycle fatigue', 'In general, the striation spacing of the fatigue damage fracture surface permits assessment of the fatigue crack growth rate. However, the brittle properties of superalloys do not always allow the formation of striations on the fracture surface as the fatigue crack grows. The authors found a characteristic pattern, called the EBSD striation, on the cross section of a serviced gas turbine bucket which had low cycle fatigue cracks. The EBSD striation seems to indicate a fatigue crack growth rate similar to the striation observed in the fatigue fracture surface of ductile materials. In this paper, in order to assess the accuracy of the low cycle fatigue crack growth rate, investigations into the cross sectional EBSD analyses of fatigue crack growth specimens made of a directionally solidified or a single crystal Ni-based superalloy were carried out. As a result of the detailed EBSD observation, striation patterns corresponding to the crack growth rate were found in the crosssection of the fatigue fracture specimen, even if the fracture surface did not have any striation patterns. Furthermore, with a sufficiently small step size for the EBSD striation spacing, it was possible to properly evaluate the crack growth rate. It was considered that the EBSD striation observed on the cross sections reveals the fatigue crack growth rate, as with striations found in the fatigue fracture surface such as relatively ductile materials.', 'C', 'Chubu Electric Power Co', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Fatigue Crack Growth Rate Assessment of Superalloy.pdf', '0', '0', '205');
INSERT INTO `data_literature_dump` VALUES ('53', 'FRICTION STIR PROCESSING OF CAST ALLOY 718', 'Bharat K. Jasthi;Edward Chen;Brahmanandam Kaligotla;Todd Curtis;Michael West;Christian Widener', '2016-12-15', 'Friction Stir Processing;Alloy 718;Castings', 'The primary objective of this work is to investigate the effect of Friction Stir Processing (FSP) on the microstructure and mechanical properties of Alloy 718 castings. Alloy 718 is often used in the cast form given the cost-effectiveness of this manufacturing approach for fabricating complex shapes near-net. The intense plastic deformation during the FSP process created a refined, recrystallized, equiaxed, and fine-grained microstructure while eliminating casting defects. Mechanical properties such as tensile, microhardness, and fatigue crack growth rates of the processed Alloy 718 were measured and compared to that of the parent material. FSP resulted in refined microstructure along with significant improvement in the tensile properties when compared to the parent material. Fatigue crack growth rate resistance for the processed material was found to be comparable with that of the parent material. The effects of post-FSP heat treatment cycles on the microstructure and mechanical properties were also analyzed and discussed.', 'C', 'Department of Materials and Metallurgical Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Friction Stir Processing of Cast Alloy 718.pdf', '0', '0', '206');
INSERT INTO `data_literature_dump` VALUES ('54', 'FULL FIELD MODELING OF THE ZENER PINNING PHENOMENON IN A LEVEL SET FRAMEWORK - DISCUSSION OF CLASSICAL LIMTTING MEAN GRAIN SIZE EQUATION', 'B. Scholtes;D. Ilin;A. Settefrati;N. Bozzolo;A. Agnoli;M. Bernacki', '2016-12-15', 'Zener pinning;level set;grain growth', 'The dragging effect exerted by second phase particles on grain growth in two-dimensional systems is investigated. Full field simulations were performed to highlight the influence of the size and the surface fraction of the precipitates on the limiting mean grain size. A modified version of the 2D classical Zener equation is finally proposed based on these numerical experiments. It is shown that the proposed model is in good agreement with other works from the literature.', 'C', 'Mines ParisTech, PSL Research University', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Full Field Modeling of the Zener Pinning Phenomeno.pdf', '0', '0', '207');
INSERT INTO `data_literature_dump` VALUES ('55', 'GRAIN BOUNDARY PRECIPITATION STRENGTHENING OF PHOSPHOURS-ADDED NICKEL-IRON BASE SUPERALLOY', 'Yusaku Hasebe;Koichi Takasawa;Takuya Ohkawa;Eiji Maeda;Takashi Hatano', '2016-12-15', 'nickel-iron base superalloy;phosphours;time to rupture;minimum creep rate;grain-boundary precipitate;grain-boundary coverage; grain-boundary precipitation strengthening', 'Creep properties of a model nickel-iron base superalloy with phosphorus (P) content of 8 to 450 ppm by mass have been investigated at 973 K under a stress of 333 MPa. The P-doped alloys exhibit many grain-boundary precipitates in which niobium and phosphorus are enriched after a certain heat treatment condition prior to the creep test. An alloy with P of 130 ppm shows a maximum value of grain-boundary coverage by the precipitates (designated as œÅ) of 0.56. The time to rupture and minimum creep rate correspond well to the value of œÅ. The rupture life was extended by up to 30 times and the minimum creep tate was decreased by more than two orders of magnitude in the alloy with P of 8 ppm, with respect to those in an alloy with P of 8 ppm where œÅ = 0. The grain-boundary precipitates remarkably delay the onset of accelerating stage (tertiary creep stage), thereby leading to the longer rupture life. These results strongly suggest that optimization of the œÅ value is a key to improve the creep properties of the alloys.', 'C', 'The Japan Steel Works', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Grain Boundary Precipitation Strengthening of Phos.pdf', '0', '0', '208');
INSERT INTO `data_literature_dump` VALUES ('56', 'HETEROEPITAXIAL RECRYSTALLIZATION OBSERVED IN REN√â 65 TM AND UDIMET 720 TM: A NEW RECRYSTALLIZATION MECHANISM POSSIBLY OCCURRING IN ALL LOW LATTICE MISMATCH Œ≥-Œ≥‚Ä≤ SUPERALLOYS?', 'Marie-Agathe Charpagne;Thomas Billot;Jean-Michel Franchet;Nathalie Bozzolo', '2016-12-15', 'Dynamic recrystallization;polycrystalline nickel-based superalloys;lattice mismatch, primary Œ≥‚Ä≤ precipitates', 'This article shows the existence of a very particular dynamic recrystallization mechanism in the Ren√© 65 and Udimet 720 alloys, that could possibly occur in other low lattice-mismatch Œ≥-Œ≥‚Ä≤ superalloys. Recrystallization nuclei are initiated by an ‚Äúinverse‚Äù (Œ≥‚Ä≤‚Üí Œ≥) phase transformation taking place in the large primary particles during slow cooling from high temperature, prior to hotdeformation. Then, during deformation, under a difference of stored energy with the surrounding matrix, the mechanism leads to a recrystallized grain embedding completely the primary particle, and with the very same orientation as the particle. The kinetics of this mechanism are presented, as a function of the temperature and strain rate of deformation.', 'C', 'MINES ParisTech, PSL - Research University', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Heteroepitaxial Recrystallization Observed in Ren√©.\' Superalloys.pdf', '0', '0', '209');
INSERT INTO `data_literature_dump` VALUES ('57', 'HIGH TEMPERATURE CREEP DAMAGE MECHANISMS IN A DIRECTIONALLY SOLIDIFIED ALLOY: IMPACT OF CRYSTALLOGRAPHY AND ENVIRONMENT', 'L. Mataveli Suave;J. Cormier;P. Villechaise;D. Bertheau;G. Benoit;F. Mauget;G. Cailletaud;L. Marcin', '2016-12-15', 'Directionally solidified superalloy;Creep;Oxidation;Grain boundaries', 'The damage mechanisms in creep have been investigated in directionally solidified Mar-M200+Hf (DS200 + Hf) alloy at high temperatures. Creep tests were performed along the solidification and transverse directions. These properties have been compared to experiments using single crystalline (SX) specimens have the same chemical composition. Creep tests were performed at 750 ¬∞C, 900 ¬∞C and 1100 ¬∞C, with a special focus on the intermediate temperature. Experiments both in air or under high vacuum were performed at this temperature, as well as experiments in air with a variation in sample thicknesses. Compared to longitudinal testing and SX experiments, shorter creep lives are systematically observed during transverse creep testing, whatever the testing temperature. This mainly results from a lower creep ductility along the transverse direction, due to an intergranular fracture mode which is assisted by oxidation at 900 ¬∞C and 1100 ¬∞C. The variation in creep life anisotropy observed between 750 ¬∞C and 1100 ¬∞C has been analyzed by considering the contribution of oxidation and local (at the grain scale) elastic and plastic behavior anisotropy. In situ monitoring of strain heterogeneities during transverse creep tests performed at 750 ¬∞C/800 MPa and at 900 ¬∞C/400 MPa shows that cracks develop between grains prone to large creep strains and at high angle boundaries. Moreover, fast oxidation and ÔÅß π-rafting seems to be the main factors reducing the creep life anisotropy.', 'C', 'Institut Pprime, CNRS - Universit√© de Poitiers - ENSMA', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\High Temperature Creep Damage Mechanisms in a Dire.pdf', '0', '0', '210');
INSERT INTO `data_literature_dump` VALUES ('58', 'HIGH TEMPERATURE PROPERTIES OF A SINGLE CRYSTAL SUPERALLOY PWA1484 DIRECTLY RECYCLED AFTER TURBINE BLADE USE', 'Satoshi Utada;Yuichiro Joh;Makoto Osawa;Tadaharu Yokokawa;Toshiharu Kobayashi;Kyoko Kawagishi;Shinsuke Suzuki;and Hiroshi Harada', '2016-12-15', 'Ni-base superalloy;Recycle;Creep;Oxidation;PWA1484;Desulfurization;Refining;Manufacturing', 'To achieve drastic cost reduction and stable supply of Ni-base single crystal superalloy turbine blades, we proposed direct recycle method that includes collecting of the components, remelting and refining in the CaO crucible, adjusting composition using the ‚ÄúCounter Alloying Method‚Äù, and recasting into single crystals. In this study, used and scrapped Ni-base single crystal superalloy PWA1484 turbine blades were directly recycled and the properties of the recycled materials were evaluated by performing high temperature tests such as creep, cyclic oxidation, and high cycle fatigue. The recycled material showed properties equal to or better than the genuine ingot material.', 'C', 'Waseda University', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\High Temperature Creep of .\'-Containing CoNi-Based Superalloys.pdf', '0', '0', '211');
INSERT INTO `data_literature_dump` VALUES ('59', 'HIGH TEMPERATURE PROPERTIES OF A SINGLE CRYSTAL SUPERALLOY PWA1484 DIRECTLY RECYCLED AFTER TURBINE BLADE USE', 'Satoshi Utada;Yuichiro Joh;Makoto Osawa;Tadaharu Yokokawa;Toshiharu Kobayashi;Kyoko Kawagishi;Shinsuke Suzuki1;Hiroshi Harada', '2016-12-15', 'Ni-base superalloy;Recycle;Creep;Oxidation;PWA1484;Desulfurization;Refining;Manufacturing', 'To achieve drastic cost reduction and stable supply of Ni-base single crystal superalloy turbine blades, we proposed direct recycle method that includes collecting of the components, remelting and refining in the CaO crucible, adjusting composition using the ‚ÄúCounter Alloying Method‚Äù, and recasting into single crystals. In this study, used and scrapped Ni-base single crystal superalloy PWA1484 turbine blades were directly recycled and the properties of the recycled materials were evaluated by performing high temperature tests such as creep, cyclic oxidation, and high cycle fatigue. The recycled material showed properties equal to or better than the genuine ingot material.', 'C', 'Waseda University', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\High Temperature Properties of a Single Crystal Su.pdf', '0', '0', '212');
INSERT INTO `data_literature_dump` VALUES ('60', 'HIGH TEMPERATURE PROPERTIES OF ADVANCED DIRECTIONALLY-SOLIDIFIED HIGH ENTROPY SUPERALLOYS', 'Te-Kang Tsao;An-Chou Yeh;Jien-Wei Yeh;Mau-Sheng Chiou;Chen-Ming Kuo;H. Murakami;Koji Kakehi', '2016-12-15', 'High entropy superalloys;directional solidification;creep resistance;oxidation;hardness', 'High-Entropy-Superalloys (HESA) with good cost-performance has been proposed. In present work, the high temperature phase stability, oxidation, hot corrosion and mechanical properties of HESA alloys were studied. The microstructure of HESA is composed of stable FCC Œ≥ matrix and L12 .... precipitates, and both .. and .... phases are highly alloyed. This .. / .... microstructure can remain stable after long term exposure at inter-mediate to high temperatures. With respect to surface stability, HESAs show high Al and Cr activities to form either protective Al2O3 or Cr2O3 rapidly. With minor additions of refractory elements, the high temperature hardness of HESA can be higher than that of conventional superalloy. HESAs show comparable tensile strength and creep rupture properties comparing to that of commercial superalloys. Furthermore, their densities are below 8.0 g.cm-3, and the cost of raw materials can be 20 % cheaper than that of CM247LC. Therefore, the potential of HESAs for high temperature applications are revealed in present article.', 'C', 'Department of Materials Science and Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\High Temperature Properties of Advanced Directiona.pdf', '0', '0', '213');
INSERT INTO `data_literature_dump` VALUES ('61', 'INCONEL 625 BY DIRECT METAL LASER SINTERING: EFFECTS OF THE PROCESS PARAMETERS AND HEAT TREATMENTS ON MICROSTRUCTURE AND HARDNESS', 'Giulio Marchese;Massimo Lorusso;Flaviana Calignano;Elisa Paola Ambrosio;Diego Manfredi;Matteo Pavese;Sara Biamino;Daniele Ugues;Paolo Fino', '2016-12-15', 'Selective laser melting;Direct metal laser sintering;Inconel 625;Microstructure;Heat treatments;Nickel base superalloys', 'The aim of this study was to investigate the INCONEL?625 (IN625) alloy processed by Direct Metal Laser Sintering (DMLS), showing the effect of different process parameters on the final density of the samples and analyzing the effects of different heat treatments on the microstructure and hardness. The results showed that there is a wide process parameter window for obtaining dense samples (with low porosity, < 0.25 %) with a fine cellular dendritic microstructure. IN625 processed by DMLS showed higher mechanical properties with respect to the same alloy after casting. Moreover, after aging treatments, carried out between 700 Áôà and 800 Áôà for 24 hours, the Brinell hardness (HBW) increased about 30% due to the precipitation of different phases. The FESEM analysis on heat-treated IN625 confirmed the presence of different precipitates such as gamma double prime (......) phase, delta (d) phase and other nanometric-sized phases. IN625 is generally used in applications that require high corrosion resistance from ambient to high temperature (up to 1000 Áôà). Therefore, the current research on heat-treated IN625 processed by DMLS could be useful for building components with high mechanical properties and high corrosion resistance in harsh environment.', 'C', 'Department of Applied Science and Technology', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Inconel 625 by Direct Metal Laser Sintering_ Effec.pdf', '0', '0', '214');
INSERT INTO `data_literature_dump` VALUES ('62', 'INFLUENCE OF CARBIDE DISTRIBUTION ON DUCTILITY OF HAYNES¬Æ282¬Æ FORGINGS', 'C Joseph1;M. Honqvist;R. Brommesson;C Persson', '2016-12-15', 'Haynes¬Æ282¬Æ;forging;anisotropic ductility', 'Haynes¬Æ282¬Æ a relatively new superalloy is used in gas turbines in form of sheets, plates and forgings. Forgings undergo a series of deformation steps at high temperatures to form complex shapes of components. The deformation on forgings, changes the microstructural features and their distribution, and any change in distribution of microstructural features can affect the mechanical properties of the material. The present study is undertaken to investigate the possible causes of anisotropy in mechanical properties of a Haynes¬Æ282¬Æforging through optical and electron microscopy. Microscopic investigations show that ductility is anisotropic and changes from 15% to 21%. The electron backscattered diffraction (EBSD) investigation reveals that the presence of carbide stringers (banding of MC and M6C carbides) is associated with fine grains, thereby giving a bimodal distribution of grain size. Carbide stringers follow the complexity of forgings and are identified as the primary cause for the anisotropic behavior in ductility. Furthermore, micromechanical simulations of carbide stringers in association with a bimodal grain structure was seen to qualitatively correspond to the experimental observation indicating improved ductility with banding along the tensile axis', 'C', 'Chalmers University of Technology', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Influence of Carbide Distribution on Ductility of .pdf', '0', '0', '215');
INSERT INTO `data_literature_dump` VALUES ('63', 'INFLUENCE OF CRISTAL ORNTATION ON CYCLIC SLIDING FRICTION AND FRETTING FATIGUE BEIIAVIOR OF SINGLE CRYSTAL Ni-BASE SUPERALLOYS', 'Balavenkatesh RengarajÔºõSotaro BabaÔºõMasakazu Okazaki', '2016-12-15', 'Secondary crystal orientation;Stress field;Coefficient of friction;Fretting fatigue crack;High temperature;Hertzian;Boussinesq-Cerruti analyses', 'The influence of the crystallographic orientation of single crystal (SC) Ni-base superalloys on the cyclic sliding friction (CSF) properties and the fretting fatigue failure was studied under ambient and high temperature conditions. A major emphasis was placed on studying the influence of the crystal orientation of the SC alloy with respect to normal load/contact pressure direction as well as with respect to frictional force/fretting direction. While the influence of contact plane on the coefficient of friction was found to be definite, a significant effect of sliding orientation on the frictional behavior was also observed. Anisotropic behavior of particular importance was found in the fretting fatigue tests. Here the life was reduced significantly compared with that of plain fatigue, and notable differences in crack initiation and growth for different secondary crystallographic orientations of contact pressure direction were identified. A mechanism-based numerical model was proposed by employing the Hertzian and Boussinesq-Cerruti analyses to provide some reasonable explanations on the above experimental results.', 'C', 'Department of Mechanical Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Influence of Crystal Orientation on Cyclic Sliding.pdf', '0', '0', '216');
INSERT INTO `data_literature_dump` VALUES ('64', 'Influence of hot working conditions on grain growth behavior of Alloy 718', 'Chuya Aoki;Tomonori Ueno;Takehiro Ohno', '2016-12-15', '718;abnormal grain growth;microstructure;strain;strain rate', 'The grain growth behavior of Alloy 718 with emphasis on abnormal grain growth (AGG) has been investigated through compression tests and subsequent solution heat treatment. Imposing a small strain, where no recrystallization occurred, resulted in AGG during thermal process which involves solution heat treatment, annealing and slow cooling after deformation. AGG occurred beyond the .. particles, with the initial grain size of ASTM 10 coarsening to about ASTM 5. Both strain and strain rate during deformation had a great influence on AGG occurrence. AGG became remarkable with decreasing strain, and the strain range where it took place shifted to larger strains with decreasing strain rate. Particularly, deformation at a low strain rate of the order of 10-3 s-1 easily led to grain growth during solution heat treatment, over the strain range even where recrystallization occurred. Such grain growth was referred to as irregular grain growth (IGG) to distinguish it from AGG.', 'C', 'Metallurgical Research Laboratory', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Influence of Hot Working Conditions on Grain Growt.pdf', '0', '0', '217');
INSERT INTO `data_literature_dump` VALUES ('65', 'INNFLUENCE OF RESIDUAL STRESSES ON THE FATIGUE LIFE OF A SHOTPEENED NICKEL-BASED SINGLE CRYSTAL SUPERALLOY: FROM MEASUREMENTS TO MODELING', 'Amelie Morancais;Mathieu Fevre;Manuel Francois;Nicolas Gue;Serge Kruch;Pascale Kanoute;Arnaud Longuet', '2016-12-15', 'Residual stress;Single crystal;Superalloy;X-ray diffraction;Lifetime prediction', 'In this work, X-ray diffraction measurements and finite elements calculations are combined to investigate the effect of the shot-peening process on the fatigue lifetime of the AM1 nickel-based single crystal superalloy. The Ortner method is used to determine residual elastic stress depth profiles in plane-parallel samples. They exhibit a 130-160 ÂÖ™m thick hardened layer where there are compressive stresses up to 1000-1400 MPa. The tensile stresses which ensure the mechanical equilibrium of the samples are not localized in a specific layer but rather distributed in a few millimeters thick layer. The eigenstrain theory is then used to incorporate measured stresses in the elasto-viscoplatic modeling of shot-peened fatigue test specimens. A numerical method is proposed to initialize hardening variables in the shot-peened layer independently of the complexity of the constitutive law or measurements in calibration samples. Finally, a fatigue analysis at 650 .C is performed in samples with a stress-concentration. The effect of shot-peening on the fatigue lifetime is studied using both modeling and measurements. Results are in good agreement in the investigated range of applied stresses. However, measurements show that residual stresses from shot peening are not always beneficial.', 'C', 'ONERA-The French Aerospace Lab', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Influence of Residual Stresses on the Fatigue Life.pdf', '0', '0', '218');
INSERT INTO `data_literature_dump` VALUES ('66', 'INHOMOGENEOUS GRAIN COARSENING BEHAVIOR IN SUPERSOLVUS HEAT TREATED NICKEL-BASED SUPERALLOY RR1000', 'I.M.D. Parr;T.J. Jackson;M.C. Hardy;D.J Child;C. Argyrakis;K. Severs;V. Saraf;J.M. Stumpf', '2016-12-15', 'RR1000;Abnormal Grain Growth;Critical Grain Growth;Supersolvus Heat Treatment;Isothermal Forging', 'RR1000 billet material has been isothermally forged using various nominal strain rate and temperature conditions. A supersolvus heat treatment has then been applied in order to assess the effect of local strain, strain rate and forging temperature on the extent of grain coarsening. This work has found that a range of forging strain exists where inhomogeneous grain coarsening is promoted during slow heating through the ... solvus temperature and results in excessively coarse final grain microstructures. Interrupted supersolvus heat treatments have shown that this process is caused by the inhibited and/or premature growth of certain grains relative to their neighbors. It has been found that excessive grain coarsening can be limited by increasing the applied forging strain rate, reducing the forging temperature or increasing the heating rate to the supersolvus heat treatment temperature. This coarsening mechanism has been described as abnormal grain growth (AGG), primarily occurring at low applied forging strain rates in the fully superplastic forging regime. It is thought to be distinct from critical grain growth (CGG) coarsening behavior which is typically related to higher applied forging strain rates where superplastic deformation is limited.', 'C', 'Rolls-Royce plc', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Inhomogeneous Grain Coarsening Behavior in Superso.pdf', '0', '0', '219');
INSERT INTO `data_literature_dump` VALUES ('67', 'INNOVATION THROUGH COLLABORATION', 'S.j. Patel;J.J. deBarbadillo', '2016-12-15', 'Supualloys;Gas Turbines;Collaborative R&D', 'The history of superalloys and their enabling role in aircraft propulsion has been a remathablc saga of technical innovation and collaboration in a never ending quesi for improved perfomiance and economy. This has been achieved in an environment of fierce competition between Original Equipment ManuThciurers (OEM‚Äôs) and between their material suppliers. Through the years, notable collaborative activities have occurred involving companica, govetnznnht laboratories and agencies and universities. The industrial and political environment and its influence on collaboration have evolved from the inception of the technology in WW H through the cold war era to the cunent era with the spread of technology throughout the world. This papei reviews this history through a modern perspective and uses examples to point to the fluture of collaborative innovation', 'M', '3200 Riverside Drive', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Innovation through Collaboration.pdf', '0', '0', '220');
INSERT INTO `data_literature_dump` VALUES ('68', 'INNOVATIONS IN CASTING TECHNIQUES FOR SINGLE CRYSTAL TURBINE BLADES OF SUPERALLOYS', 'Dexin Ma;Fu Wang;Qiang Wu;Samuel Bogner;Andreas B√ºhrig-polaczek', '2016-12-15', 'Superalloy;Bridgman process;Directional solidification;Single crystal;Turbine blade', 'A series of novel casting techniques for single crystal (SC) blades of superalloys were presented which were developed in our institutions. Based on the Bridgman process, the Grain Continuator (GC) and the Heat Conductor (HC) techniques were developed to minimize the heat barrier which hinders the lateral SC growth from the blade body into the platform‚Äôs extremities. To achieve symmetric thermal conditions for the SC solidification in the blade clusters, the Parallel Heating and Cooling (PHC) system was employed. The negative shadow effect in the current Bridgman process and the related defects were significantly reduced. The Dipping and Heaving (D&H) technique using thin shell molds enables a high temperature gradient to be obtained for SC growth and freckle free solidification of the superalloy castings. In terms of the analysis of the solidification processing in the complex turbine blades, a new concept of a three dimensional (3D), precise control of the SC growth was proposed. Corresponding to this, a Targeted Cooling and Heating (TCH) technique was developed to dynamically establish a proper thermal arrangement for the microscopic control of the SC growth in the critical areas of large industrial gas turbine (IGT) blades. Combining the TCH and D&H Technology, a more effective and precise control of local SC growth can be achieved based on the significant improvement of macroscopic cooling conditions.', 'C', 'Foundry Institute', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Innovations in Casting Techniques for Single Cryst.pdf', '0', '0', '221');
INSERT INTO `data_literature_dump` VALUES ('69', 'INTEGRATED PROCESS MODELING FOR THE MECHANICAL PROPERTIES OPTIMIZATION OF DIRECT AGED ALLOY 718 ENGINE DISKS', 'Bernd Oberwinkler;Andreas Fischersworring-Bunk;Marco H√ºller;Martin Stockinger', '2016-12-15', 'Mechanical properties;Direct aging;Modeling;Yield strength;Creep behavior', 'To meet the challenging requirements of future alloy 718 engine components, it is necessary to enable optimized processing and deliver forgings with tailored properties. In this paper, an integrated process modeling procedure is presented which is able to predict mechanical properties such as yield strength, low cycle fatigue and creep behavior of direct aged alloy 718 forgings. It includes thermo-mechanical process modeling in DEFORM. (DEFORM. is a registered trademark of Scientific Forming Technologies Corporation), thermo-kinetic precipitation modeling in MatCalc, mechanical properties post-processing in BoMePP and visualization in ParaView. With respect to yield strength modeling, the following six strengthening contributions of direct aged alloy 718 are discussed in detail: basic yield strength, strain hardening, grain boundary strengthening, precipitation strengthening, solid solution strengthening, and the direct age effect. Furthermore, a relative importance of these strengthening contributions is presented. Verification of the integrated process modeling procedure and the according optimization potential for alloy 718 engine disks are examined on the basis of experimental results.', 'C', 'B√∂hler Schmiedetechnik GmbH & Co KG', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Integrated Process Modeling for the Mechanical Pro.pdf', '0', '0', '222');
INSERT INTO `data_literature_dump` VALUES ('70', 'INTEGRATED THERMAL PROCESS OPTIMIZATION OF ALLOY 718PLUS¬Æ FOR ADDITIVE MANUFACTURING', 'Jiadong Gong;Hallee Z. Deutchman;Alonso Peralta;Dave Snyder;Michael P. Enright;John McFarland;James Neumann;Jason Sebastian;Greg Olson', '2016-12-15', '718Plus;microstructure;additive manufacturing;ICME', 'Honeywell AerospaceÊäØ DARPA Open Manufacturing program (DARPA OM) is a combined effort of integrated computational materials engineering (ICME) models and mindset enabling a rapid qualification of components for the aerospace industry. The program focuses on laser beam additive manufacturing of Nickelbased Alloy 718Plus, emphasizing an integrated empirical and modeling effort for prediction of material properties produced by this novel process. As this emerging additive manufacturing technology matures, it has forced tools to model and simulate the intricate process to advance to a new level. The complexity during the additive process, such as the rapid heating rates, cooling rates, and transient phase transformation, brings increased uncertainty to the microstructure and material properties of the components. The post build processing for ATI 718Plus?Alloy used in this program includes a Stress Relief (SR) followed by Hot Isostatic Pressure (HIP) cycle, and then Solution Heat Treatment (SHT) followed by a two-step Aging. However, the standard post treatment that has been developed for the traditionally formed material often falls short for the additively processed material. This program focuses on mining empirical data to build the next generation of models, and drive future rapid qualification of aerospace components. This paper will discuss the unique microstructure evolution that results from additive manufacturing, how the DARPA team calibrated and validated ICME models for that evolution and for strength modeling, and how the resulting models assisted the development of a new optimized stress-relief temperature.', 'C', 'QuesTek Innovations', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Integrated Thermal Process Optimization of Alloy 7.pdf', '0', '0', '223');
INSERT INTO `data_literature_dump` VALUES ('71', 'INVESTIGATION OF OXIDE BIFILMS IN INVESTMENT CAST SUPERALLOY IN100', 'M.A. Kaplan;R.K. Guarriello;G.E. Fuchs', '2016-12-15', 'IN100;Investment Casting;Superalloys;bifilms;inclusions', 'Oxide bifilms are a recently proposed casting inclusion reported to have been observed in vacuum investment cast polycrystalline Ni-base superalloys. The effect of casting atmosphere, turbulence, filtering, hot isostatic pressing (HIP), and heat treatment have been investigated to identify the critical parameters that have been reported to result in bifilm formation in Ni-based superalloys. Room temperature tensile and room temperature fatigue testing was used to identify the effects of each casting and processing parameter on casting anomaly formation and the resultant effects on mechanical properties. Analyzed tensile and fatigue data did not indicate an influence of bifilms on the tensile or fatigue strength of vacuum processed IN100. Bifilms were not observed, via the characterization methods utilized, to be an active mechanism in tensile or fatigue fracture.', 'C', 'Department of Materials Science and Engineering University of Florida', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Investigation of Oxide Bifilms in Investment Cast .pdf', '0', '0', '224');
INSERT INTO `data_literature_dump` VALUES ('72', 'INVESTIGATION OF SUPERALLOY COMPOSITION SPACE USING HIGH THROUGHPUT THIN FILM SYNTHESIS AND SYNCHROTRON X-RAY DIFFRACTION', 'LD Connor;PM Mignanelli;S Gu√©rin;JP Souli√©;C Mormiche;S Frost;R Greenhalgh;BE Hayden;HJ Stone', '2016-12-15', 'TCP;High-throughput;Synchrotron;X-ray diffraction;SEM', 'The development of new nickel-base superalloys, which commonly contain in excess of 10 alloying elements, is a challenge with nearly unparalleled complexity. The vast number of alloying element combinations and the amount of each element that can be added means that the efficient design of new alloys requires the use of computational techniques. However, the viability of the computationally designed alloys is founded upon the fidelity of the databases used to calculate the thermodynamic equilibrium phases. In this work, high-throughput physical vapor deposition has been used to assess the Ni‚ÄìCr‚ÄìW and Ni‚ÄìCr‚ÄìCo ternary systems. The synthesis of compositionally graded thin film samples has allowed a large area of composition space to be assessed and the use of synchrotron X-ray diffraction to analyze the thin film samples has provided a method of phase identification at a resolution beyond that achievable with laboratory-based techniques. The data acquired has allowed previously unknown phases in these ternary systems to be identified, the extent of the constituent phase fields to be determined and enabled the compositional dependence of the  lattice parameter to be obtained.', 'C', 'Diamond Light Source Limited', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Investigation of Superalloy Composition Space Usin.pdf', '0', '0', '225');
INSERT INTO `data_literature_dump` VALUES ('73', 'MANUFACTURE OF LARGE Ni-BASE INGOTS AND FORGINGS', 'Nikolaus Blaes;Bernhard Donth;Andreas Diwo;Dieter Bokelmann', '2016-12-15', 'Ni-Base;Alloy 263;TOS1X;Forgings;Triple Melt;ESR;VAR;Power Generation;Ultra supercritical;Nextgenpower', 'In the last years, development steps have taken place to increase the weight of Ni-base forgings. Amongst other aspects, the development of fossil power plants with steam temperatures of 700 ¬∞C and above partly requires replacement of steel components by Ni-base material. This concerns mostly the boiler and the turbine of the power plant. Design engineering targets small components as far as possible, i.e. only the middle part of a turbine is made of Ni-base material which is welded to high chromium steel to build a complete turbine shaft. Saarschmiede has produced several trial shafts in Alloy 617 and Alloy 625 from ESR ingots with weights up to 39 t. Within the context of the NextGenPower project, Alloy 263 was determined to be a promising candidate material for steam temperatures of 750 ¬∞C. Within this program, Saarschmiede has remelted an Alloy 263 ingot with a weight of 23 t, which is the largest worldwide, by triple melt, and a full scale trial shaft was produced. Apart from this, ESR ingots in Alloy 600 have been produced with diameters of 1300 mm and weights of up to 70 t, the largest ever produced in this grade worldwide.', 'C', 'Saarschmiede GmbH Freiformschmiede', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Manufacture of Large Ni-Base Ingots and Forgings.pdf', '0', '0', '226');
INSERT INTO `data_literature_dump` VALUES ('74', 'MECHANICAL PROPERTIES AND MICROSTRUCTURE DESIGN IN REPAIRING MAR-M 509 ALLOY TURBINE COMPONENTS', 'Zengmei Wang Koenigsmann;Ravi Shankar;Richard Fenton', '2016-12-15', 'Co-base Superalloy;Microstructure Stability;Diffusion Brazing Repair', 'The study of different repair heat treatment routes on microstructure engineering and the resulting mechanical response in Mar-M 509 alloy is presented. The aim of this study is to establish a comprehensive correlation between the repair thermal heat treatments and the mechanical properties in Mar-M 509 alloy and use this correlation as a guide to define an optimal heat treatment path to repair and rejuvenate gas turbine components made of Mar-M 509 alloy. The microstructural characterizations in the heat treated samples were performed using Optical Microscopy (OM) and Scanning Electron Microscopy (SEM) to reveal carbide precipitation and dissolution associated phase transformation at various stages. The mechanical properties were assessed via tensile and creep rupture tests at elevated temperatures. A significant tensile ductility loss of the alloy was observed at around 1149 ¬∫C (2100 ¬∫F), which is associated with the secondary M23C6 carbide precipitation at the primary MC carbide interface and the grain boundaries. The examinations on the ruptured surfaces further show that the failure mechanism in the sample heat treated at 1149 ¬∫C (2100 ¬∫F) is due to the fractures within the grains and at the grain boundaries. Due to the complexity of the carbide precipitation in the alloy and the alloy condition at post engine run, the ideal temperature for alloy rejuvenation was found to be within a narrow range from 1204 ¬∫C (2200 ¬∫F) to 1232 ¬∫C (2250 ¬∫F). The derived repair thermal process based on the above assessments was further validated', 'C', 'Chromalloy Gas Turbine LLC', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Mechanical Properties and Microstructure Design in.pdf', '0', '0', '227');
INSERT INTO `data_literature_dump` VALUES ('75', 'MECHANICAL PROPERTIES OF CAST & WROUGHT HYBRID DISKS', 'Hesser Taboada Michel;Layla Sasaki Reda;Georgia Effgen Santos;Jonathan Cormier;Christian Dumont;Patrick Villechaise;Philippe Bocher;Damien Texier;Eric Georges;Florent Bridier;Florence Hamon;Alexandre Devaux  ', '2016-12-15', 'Cast & Wrought superalloys;Creep;Fatigue;Tensile properties;Dual Properties Disks', 'This paper summarizes five years of joint efforts by Aubert & Duval,  Ecole  de  Technologie  Sup√©rieure,  and  ISAE- ENSMA/Institut Pprime in developing microstructure graded turbine disks. It is mainly focused on the characterization of the mechanical properties of cast & wrought hybrid disks made of UDIMET TM 720Li and the newly developed AD730 TM alloys. In such disks, a coarse grain structure (grain size greater than 100 Œºm) has been introduced in the rim sections, where time dependent damage processes (creep, dwell-fatigue crack growth) are the main life limiting factors, while bore sections keep a fine grain structure (grain size between 5 to 15 Œºm). Smooth disks with a various diameters and height were processed and investigated. Tensile properties at room temperature, 550 ¬∞C, and 700 ¬∞C, creep properties at 700 ¬∞C/750 MPa, 770 ¬∞C/540 MPa, and 850 ¬∞C/300 MPa together with low cycle fatigue properties at 550 ¬∞C were investigated as a function of radial position. Moreover, the effect of an aging heat treatment after the dual microstructure heat treatment (DMHT) has also been investigated. From this study, it is shown that tensile and low cycle fatigue (LCF) properties, as well as creep properties at 770 ¬∞C/540 MPa and 850 ¬∞C/300 MPa, are mainly controlled by the grain size, whatever the ÔÅß‚Ä≤ precipitation state. Moreover, a ÔÅß‚Ä≤-subsolvus solution heat treatment is recommended after the DMHT to homogenize the intragranular microstructure through the disks and optimize tensile and LCF properties in the bore sections. Finally, creep and tensile properties in the grain size transition areas are shown to be highly dependent to the fraction of coarse grains.', 'C', 'Aubert & Duval;Institut Pprime;Ecole de Technologie Sup√©rieure;Now at DCNS Research', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Mechanical Properties of Cast & Wrought Hybrid Dis.pdf', '0', '0', '228');
INSERT INTO `data_literature_dump` VALUES ('76', 'MICROSTRUCTURAL ASPECTS OF FATIGUE CRACK INITIATION AND SHORT CRACK GROWTH IN REN√â 88DT', 'Zafir Alam;David Eastman;George Weber;Somnath Ghosh;Kevin Hemker ', '2016-12-15', ' Micro-bending fatigue;Ren√© 88DT superalloy;ICME', 'The effect of local microstructure on fatigue crack initiation and propagation in polycrystalline Ren√© 88DT * superalloy specimens has been examined at room temperature. Miniaturized samples were fatigue tested in reverse cycle bending in a novel resonance micro-bending fatigue setup. Concomitant analyses of the surface microstructure with orientation mapping, scanning electron microscopy,  and  confocal  microscopy  facilitated  direct experimental measurements of the specific microstructural locations associated with: slip and slip band formation, microcrack  initiation,  and  short-crack  propagation.  The underlying mechanisms were observed to be: slip on {111} planes with the highest resolved shear stress, subsequent initiation of microcracks preferentially along, but not at, twin boundaries in large grains oriented for high shear and experiencing elastic incompatibility, and successive propagation of cracks on {111} planes with high resolved shear stresses in the neighboring grains. Analyses of many short non-propagating cracks revealed crack arrest at high-angle grain boundaries.', 'C', 'Department of Mechanical Engineering; Department of Civil Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Microstructural Aspects of Fatigue Crack Initiatio.pdf', '0', '0', '229');
INSERT INTO `data_literature_dump` VALUES ('77', 'MICROSTRUCTURE CHANGES AND OXIDATION RESISTANCE OF ALUMINIZED Ni-BASED SINGLE CRYSTAL SUPERALLOYS', 'Hideyuki Murakami and Kazuki Kasai', '2016-12-15', 'Aluminize;Orientation;Recrystallization;Thermal history', 'Microstructural changes and oxidation resistance of simply aluminized  Ni-based  single-crystal  superalloys  were systematically  investigated.  There  are  several  kinds  of microstructural changes observed in the as-aluminized Ni-based single crystal superalloys. For instance, in the case of a grit- blasted specimen, secondary reaction zone (SRZ) was formed in the vicinity of substrate/coating interfaces. On the other hand, in the polished specimens, voids were formed by thermal cyclic heating. It is also found that grit-blasted specimens with SRZ formation  exhibited  accelerated  oxidation.  Microstructural changes are slightly accelerated along <110> direction rather than <100> direction. These experimental results can be explained by the recrystallization of substrate surfaces and subsequent interdiffusion between the coated layer and the substrate. Cyclic oxidation tests were also performed to assess the oxidation resistance of specimens with different microstructure and it is found that specimens with SRZ formation demonstrated worse oxidation resistance than those with voids formation, probably due to the difference in interdiffusion of solute elements between aluminized coatings and substrates.', 'C', 'Surface and Interface Kinetics Group', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Microstructure Changes and Oxidation Resistance of.pdf', '0', '0', '230');
INSERT INTO `data_literature_dump` VALUES ('78', 'MICROSTRUCTURE INSTABILITY OF Ni-BASE SINGLE CRYSTAL SUPERALLOYS DURING SOLUTION HEAT TREATMENT', 'N. D\'Souza;D. Welton;J. Kelleher;G. D. West;Z.H. Dong;G. Brewster;H. B. Dong ', '2016-12-15', 'Microstructure instability;Ni-base alloys;Single Crystal Superalloys;Solution heat treatment', 'Microstructure instability that develops at the surface during solutioning heat treatment of a typical 3rd generation Ni-base superalloy, CMSX10N ? has been studied. The anomalous microstructure  that  develops  was  observed  to  exhibit discontinuous precipitation morphology. It occurs at temperatures approaching the ? ? solvus, where volume diffusion is dominant. Discontinuous precipitation comprises of a ? ? matrix and nucleation of W, Re and Cr-rich phases with a typical needle-like morphology having a polycrystalline microstructure. The growth of the discontinuous precipitation layer is also accompanied by diffusion of Al ahead of the boundary leading to ? ? precipitation and is accompanied by a loss in the driving force available for advancement of the grain boundary. Accordingly, by tracking the rate of ? ? precipitation using in-situ neutron diffraction during isothermal hold it was possible to calculate the loss in driving force. The driving force calculated for the initial stages of discontinuous precipitation is [10 -5 ‚Äì 10 -4 ] N/?m 2 of the grain boundary]. Nearly all of this force was available to pull the grain boundary.', 'C', 'Rolls-Royce plc;ISIS Facility;Warwick Manufacturing Group;Department of Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Microstructure Instability of Ni-Base Single Cryst.pdf', '0', '0', '231');
INSERT INTO `data_literature_dump` VALUES ('79', 'MICROSTRUCTURE-SENSITIVE MODEL FOR PREDICTING SURFACE RESIDUAL STRESS RELAXATION AND REDISTRIBUTION IN A P/M NICKEL-BASE SUPERALLOY', 'M.E. Burba;D.J. Buchanan;M.J. Caton;R. John;R.A. Brockman', '2016-12-15', 'IN100;Residual stress;shot peening;X-ray diffraction;Œ≥\'precipitates', 'Compressive surface residual stress achieved by mechanical surface treatments (i.e. shot peening, low-plasticity burnishing, laser shock peening, etc.) typically extend component life under fatigue loading. Designers are reluctant to include surface residual stress benefit in design life predictions due to the absence of detailed and accurate models of this behavior and the uncertainty of residual stress profiles that exist both before and after service. Therein lies a need for generalizing current coupled creep-plasticity models to incorporate microstructural features, size distributions, and volume fractions to describe the relaxation mechanisms as integrated computational materials engineering (ICME) practices take hold within the industrial base. The microstructure-sensitive models developed in this research combine the effect ?\' precipitates have on mechanical properties (i.e. yield strength and creep) within a coupled creep-plasticity model framework and baseline residual stress and plastic strain profiles as initial boundary conditions for predicting residual stress relaxation under thermomechanical exposure. Model predictions are validated against shot peened laboratory scale experiments of two different heat treatments of IN100 under service relevant conditions.', 'C', 'Air Force Research Laboratory (AFRL/RXCM);University of Dayton Research Institute', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Microstructure-Sensitive Model for Predicting Surf.pdf', '0', '0', '232');
INSERT INTO `data_literature_dump` VALUES ('80', 'MULTISCALE MODELING OF HEAT TREATMENT PROCESSING FOR SINGLE-CRYSTAL N?- BASE SUPERALLOYS', 'Chen Shen;Akane Suzuki;Douglas G. Konitzer', '2016-12-15', 'Homogenization modeling;Microsegregation;Œ≥\' precipitation modeling;Single crystal;Ren√© N515', 'A multi-component diffusion model coupled with CALPHAD thermodynamic and kinetics data was applied to simulate homogenization heat treatment for Ren√© N515 on a 2D cross- section. Different from conventional 1D models, spatial dendritic microstructures were explicitly taken into account. The predicted microsegregation evolution agreed well with EPMA experimental data. Incipient melting and topologically closed packed (TCP) phases were simulated. The effects of spatial microstructure and Œ≥\' dissolution were found to be a main reason for deviation of homogenization kinetics from a linear form of ?????, derived from diffusion equation. Œ≥\' precipitation was simulated for Ren√© N515 under aging conditions. The predicted Œ≥\' coarsening was found in good agreement with experiment. The precipitation model can be combined with homogenization modeling to correlate heat treatment, residual microsegregation, and Œ≥\' microstructure.', 'C', 'GE Global Research;GE Aviation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Multiscale Modeling of Heat Treatment Processing f.pdf', '0', '0', '233');
INSERT INTO `data_literature_dump` VALUES ('81', 'NOVEL TECHNIQUES TO ASSESS ENVIRONMENTALLY-ASSISTED CRACKING IN A NICKEL- BASED SUPERALLOY', 'Andr√© A. N. N√©meth;David J. Crudden;David M. Collins;David E. J. Armstrong;Roger C. Reed', '2016-12-15', 'Mechanical testing;Environmental degradation;Intergranular fracture', 'A number of drawbacks are associated with conventional mechanical testing methodologies for nickel-based superalloys: (i) a substantial amount of material is needed, which exacerbates cost, (ii) thus for alloy development purposes ‚Äì when the quantity of material is often limited ‚Äì it may not be possible to do the necessary range of tests required to assess fully the properties, (iii) it does not always provide sufficient insight into the mechanisms occurring locally, especially on the length-scales of the grains. Here, an electro-thermal-mechanical testing (ETMT) system is employed between room temperature and 900 ¬∞C which circumvents some of these difficulties. Miniature test specimens of small cross-section of 1√ó1 mm 2  are employed; this allows for rapid mechanical property assessment from small quantities of material. It is demonstrated that time-dependent damage mechanisms in a polycrystalline nickel-base superalloy can be studied. Slow strain- rate testing at high temperature in both oxidizing and inert environments is used to assess the susceptibility of the alloy to environmentally-assisted cracking. Micro-mechanical tests ‚Äì using micro-cantilever bend tests ‚Äì are conducted at both virgin grain boundaries and at oxidized secondary crack-tips, thus providing insight into the mechanisms of fracture during environmentally- assisted cracking. These novel methods for mechanically assessment ‚Äì combined with high resolution characterization techniques ‚Äì allow the susceptibility of a nickel-based superalloy to environmentally-assisted cracking to be assessed.', 'C', 'University of Oxford', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Novel Techniques to Assess Environmentally-Assiste.pdf', '0', '0', '234');
INSERT INTO `data_literature_dump` VALUES ('82', 'ON THE DEVELOPMENT OF ICME TOOLS FOR CREEP AND AGING OF CMSX¬Æ-8', 'E.A. Estrada Rodas;S. Gorgannejad;R.W. Neu;Z. Dyer;P.M. Draa;and S.R. Shinde', '2016-12-15', 'aging;creep;crystal viscoplasticity;diffusivity;Ni-base superalloy;rafting', 'In this paper three different tools are developed to aid Integrated Computational Materials Engineering (ICME) of Ni-base superalloys for next generation industrial gas turbines: (i) models to predict the state of the ÔÅßÔÄØÔÅß\' structure through modeling of the kinetics of aging, including both rafting and coarsening, (ii) a crystal viscoplasticity (CVP) model for determining the creep and cyclic deformation response that uses the current state of the ÔÅßÔÄØÔÅß\' structure as is an input, and (iii) the use of computational thermodynamics and kinetics software for multi-component systems to determine how diffusivity, which is a key parameter in the aging and in viscoplasticity models, is altered with variations in composition of the ÔÅß and ÔÅß\' phases. Experiments are conducted on a reduced Re content superalloy, CMSX¬Æ-8, to determine the parameters of the aging and crystal viscoplasticity models', 'C', 'The George W. Woodruff School of Mechanical Engineering; School of Materials Science and Engineering;Siemens Energy Inc; Siemens Energy Inc', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\On the Development of ICME Tools for Creep and Agi.pdf', '0', '0', '235');
INSERT INTO `data_literature_dump` VALUES ('83', 'ON THE TEMPERATURE DEPENDENCE OF CREEP BEHAVIOR OF N?-BASE SINGLE?CR?STAL?SUPERALLOYS', 'P.Wollgramm;X. Wu;G.Eggeler ', '2016-12-15', 'Ni-base single crystal;creep;anisotropy;transmission electron microscopy', 'In the present work we investigate the creep behavior of a single crystal superalloys (SX), using precisely oriented miniature tensile creep specimens. We study the single crystal superalloy ERBO/1 (CMSX-4 type) in the temperature range between 1023 and 1323 K. We investigate how creep rates evolve in different stress/temperature regimes when tests are performed in the crystallographic loading directions [001], [110] and [111] and on how minimum creep rates depend on stress and temperature. Special emphasis is placed on the early stages of creep in the low temperature/high stress regime at 1023 K and 800 MPa.', 'C', 'Institut f√ºr Werkstoffe', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\On the Temperature Dependence of Creep Behavior of.pdf', '0', '0', '236');
INSERT INTO `data_literature_dump` VALUES ('84', 'OXIDATION COATING LIFE EXTENSION IN GAS TURBINE BLADES DURING REPAIR', 'Dheepa Srinivasan;N. Dayananda;Neha Kondekar;Mounika Gandi;Hariharan Sundaram ', '2016-12-15', 'MCrAlY;Aluminide Coating;Diffusion;Thermal spray;Ni based super alloy GTD 111;Oxidation;Rejuvenation Heat treatment;Electron microscopy', 'Gas turbine blades have oxidation protection coating, on the external surface as well as on the internal cooling holes to protect the Ni based super alloy hardware from oxidation, during service operation. The external coatings are thermally sprayed MCrAlY coatings, having a thickness of 200-300 Œºms. The internal coatings are diffusion aluminides, measuring between 75-100 ?msIn both the coatings, the presence of a ?-NiAl phase serves as a protective phase in the coating that prevents the base metal from oxidation. Rejuvenation heat treatment is sometimes given to the base metal to restore the service exposed blade microstructure to enable life extension of the hardware to another service interval. A comparison of the service exposed (after 36000 h) and rejuvenated coatings reveals both types of coatings to be intact without any degradation to the coating properties, delamination from the substrate or incipient melting during the rejuvenation heat treatment, thus enabling coating life extension, without having to strip and recoat, during repair and refurbishment.', 'C', 'GE Power;Georgia Tech University;Materials Engineering', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Oxidation Coating Life Extension in Gas Turbine Bl.pdf', '0', '0', '237');
INSERT INTO `data_literature_dump` VALUES ('85', 'OXIDE SCALE FORMATION IN NOVEL Œ≥ Œ≥-Œ≥ Œ≥\' COBALT-BASED ALLOYS', 'C.A. Stewart;R.K. Rhein;A. Suzuki;T.M. Pollock;C.G. Levi', '2016-12-15', 'Cobalt alloys;Oxidation;Combinatorial study', 'Oxidation behavior has been investigated for three cast novel Co- base Œ≥-Œ≥\' alloys and a subset of alloys produced by combinatorial ion plasma deposition exploring the effect of Ni:Co ratio and Al content. Oxidation was performed at 1100 ¬∞C for 1 h in flowing dry air; the oxide scale was characterized by luminescence spectroscopy and scanning electron microscopy (SEM) with energy  dispersive  spectroscopy  (EDS).  First-principles thermodynamic modeling of Co-Ni-W-Al-Cr-Ta-O compositions predicts Œ±-Al 2 O 3 for all two-phase Œ≥-Œ≥\' alloys, but alumina may often form internally as discrete particles rather than as a continuous surface scale. Experimental assessment of Œ±-Al 2 O 3 scale formation by combinatorial synthesis suggests that minimum levels of Al and Ni:Co are needed, but the effect of the Ni:Co ratio is likely modest above the critical Al content.', 'C', 'Materials Department;GE Global Research', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Oxide Scale Formation in Novel .-.\' Cobalt-Based Alloys.pdf', '0', '0', '238');
INSERT INTO `data_literature_dump` VALUES ('86', 'PARAMETER OPTIMIZATION FOR ELECTRON BEAM MELTING OF IN718 BASED ON MELT POOL CHARACTERIZATION', 'Xiao Ding;Yuichiro Koizumi;Akihiko Chiba', '2016-12-15', 'process parameter;melt pool;electron beam melting;IN718', 'Single bead experiments were conducted to clarify the relationship between process parameters and melt pool geometry based on melt pool characterization, aiming to obtain a better understanding of Electron  Beam  Melting  (EBM)  additive  manufacturing. INCONEL¬Æ 1 718 polycrystalline plate and gas atomization powders were used to generate melt pool geometries by various beam power and scan speed combinations. The surface morphology and cross section microstructures were analyzed. The surface morphology indicates that input energy play an important role in single beads continuity. The microstructure of fully columnar grains is verified by cross-section profile of single beads. Furthermore, the melt pool widths and depth increase almost linearly with beam power on the basis of the cross-sectional geometrical profiles. A reciprocal relationship exists between width/depth ratio and line energy. Finally, process condition has profound effect on crystal growth and grain structure. Grains grow along different direction in relatively high line energy cases. However, grains grow almost along the same direction namely grow vertically in relatively low line energy cases.', 'C', 'Department of Materials Processing;Institute for Materials Research (IMR)', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Parameter Optimization for Electron Beam Melting o.pdf', '0', '0', '239');
INSERT INTO `data_literature_dump` VALUES ('87', 'PHYSICS-BASED MODELING TOOLS FOR PREDICTING TYPE II HOT CORROSION IN NICKEL-BASED SUPERALLOYS', 'K.S. Chan;M.P. Enright;J.P. Moody;S.H.K. Fitch', '2016-12-15', 'hot corrosion;life-prediction;mechanistic modeling;ME3;Ren√© 104', 'A physics-based hot corrosion life-prediction methodology has been developed to treat pit-induced fatigue crack growth in engine disks. This framework has been developed on the basis that hot corrosion commences with the deposition of alkali sulfates on the metal surfaces. The attack by molten sulfates leads to the dissolution of protective oxide and the formation and growth of hot corrosion pits on the metal surface, followed by fatigue crack nucleation at corrosion pits and the propagation of a fatigue crack to final fracture. This hot corrosion-induced time-dependent fatigue crack growth model has been implemented into a probabilistic life-prediction code called DARWIN ¬Æ* . Application of this life-prediction methodology to treat hot corrosion in a generic engine disk is demonstrated via benchmark calculations.', 'C', 'Southwest Research Institute;Elder Research Inc', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Physics-Based Modeling Tools for Predicting Type I.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('88', 'PRECIPITATION KINETIC MODELING OF THE NEW ETA-PHASE Ni6AlNb IN Ni-BASE SUPERALLOYS', 'Markus Rath;Erwin Povoden-Karadeniz;Ernst Kozeschnik', '2016-12-15', 'Ni-base superalloy;CALPHAD modeling;Œ∑-phase', 'Eta phase stabilities were evaluated in consideration of new experimental data on the Ni-base superalloy, ATI718Plus. It has been found that thepreviously suggested miscibilitybetween Ni 3 Ti ?????????? ???? ???? ?? 6 ????? ????????? ??????????? ???? ????? overestimated. A new thermodynamic model description is proposed which is also applicable to kinetic simulations of the ??????????????????????????????????????????????????????????????? superalloys.', 'C', 'Institute for Materials Science and Technology; Materials Center Leoben Forschung GmbH', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Precipitation Kinetic Modeling of the New Eta-Phas.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('89', 'PROBABILITY OF OCCURRENCE OF LIFE-LIMITING FATIGUE MECHANISM IN P/M NICKEL- BASED SUPERALLOYS', 'S. K. Jha;W. J. Porter;M. J. Caton;R. John, D. J. Buchanan;A. H. Rosenberger;and J. M. Larsen', '2016-12-15', 'Probability of occurrence;Fatigue life prediction;Life-limiting mechanism;Superalloy', 'The mean and the minimum fatigue lifetimes are often produced by different mechanisms [1, 2]. In this paper, a microstructure-based model of the probability of occurrence of the minimum-lifetime, or the life-limiting, mechanism in powder processed Ni-base superalloys is discussed. The life-limiting mechanism in the stress level and temperature regimes of interest was taken to correspond to surface crack initiation from a non-metallic particle. The model by Tanaka and Mura [3] for crack initiation due to blocking of a slip band at a non-metallic particle was adapted in formulating a microstructural criterion for the life-limiting mechanism. The probability of occurrence was based on a Monte Carlo analysis using random instantiations of microstructural volumes containing combinations of non-metallic particle and grain neighborhoods. The model was exercised to study the probability of occurrence of life-limiting failures with respect to microstructure, temperature, stress level, and volume. The predicted trends are discussed with reference to published results on Ni-based superalloys.', 'C', 'US Air Force Research Laboratory;Universal Technology Corporation; University of Dayton Research Institute', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Probability of Occurrence of Life-Limiting Fatigue.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('90', 'RELATIONSHIP BETWEEN THE MICROSTRUCTURE, LOW CYCLE FATIGUE AND CREEP PROPERTIES OF A CAST AND WROUGHT N?-C? BASE SUPERALLOY TMW-4M3 DISK', 'Shinichi Kobayashi;Tomonori Ueno;Takehiro Ohno;Hiroshi Harada', '2016-12-15', 'Ni-Co base;TMW alloy;disk, TMW-4M3;Œ≥\';creep;fatigue', 'A series of cast and wrought (C&W) Ni-Co base superalloy TMW (TMW is a trademark of National Institute for Materials Science registerd in Japan.) alloys, was developed for applications of turbine disks and other components. TMW-4M3 has excellent creep resistance among the lineup of TMW alloys. A TMW-4M3 disk with increasing amounts of strengthening elements (Ti, B and Zr) was produced via improved hot-working process, starting from an ingot of industrial triple-melt (vacuum induction melting / electro-slag remelting / vacuum arc remelting). To investigate the effect of the microstructure on fatigue and creep properties, another TMW-4M3 disk with standard composition produced by previous trial (not improved) processes and an Alloy 720Li disk were also prepared as references. A TMW-4M3 disk via improved process had fine grains pinned by primary Œ≥\' particles after solution heat-treatment at 1100¬∞C. ALA grain size of this disk was finer than that of a previous trial disk, though average grain sizes were similar. This TMW-4M3 disk having small ALA grain exhibited long fatigue life at 400¬∞C compared to other disks. In addition, creep rupture life at 725¬∞C of this TMW-4M3 disk was longer than those of a previous trial disk and Alloy 720Li disk due to larger amounts of Ti, B and Zr. Therefore, these results show that this improved TMW-4M3 disk had good low cycle fatigue properties and creep resistances.', 'C', 'Hitachi Metals;;National Institute for Materials Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Relationship between the Microstructure, Low Cycle.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('91', 'RELATIONSHIPS BETWEEN MICROSTRUCTURAL PARAMETERS AND TIME-DEPENDENT MECHANICAL PROPERTIES OF A NEW NICKEL BASED SUPERALLOY AD730 TM', 'Louis Th√©baud;Patrick Villechaise;Jonathan Cormier;Florence Hamon;Coraline Crozet;Alexandre Devaux;Jean-Michel Franchet;Anne-Laure Rouffi√©;Antoine Organista', '2016-12-15', 'AD730 TM;cast & wrought superalloys;high temperatures;creep;dwell-fatigue;inter/intra granular properties;oxidation', 'High temperature viscoplastic properties of the new nickel-based superalloy AD730 TM have been investigated, under creep and dwell-fatigue loading conditions. The aim of this study is to evaluate the influence of several microstructural parameters on these properties. Three microstructures have then been tested in creep and dwell-fatigue, at 700 ¬∞C and 850 ¬∞C: a Fine Grain microstructure, a Coarse Grain one and a Single Crystalline microstructure. The creep-controlling parameters at 850 ¬∞C are the grain size and intragranular Œ≥‚Ä≤ volume fraction, whereas at 700 ¬∞C, these controlling parameters depend on the applied stress. Indeed, depending on the applied stress, changes of creep deformation mechanisms have been evidenced for both the Fine and Coarse Grain microstructures. Dwell-fatigue tests revealed that depending on the applied stress, the influence of the unloading phase may have a beneficial impact on the overall behavior. An attempt is proposed to explain this phenomenon, by highlighting the appearance of a ‚Äúnegative plastic deformation‚Äù occurring during the unloading phase in dwell- fatigue tests at high maximum applied stresses.', 'C', 'Aubert & Duval;Institut Pprime;Safran SA;Safran Turbomeca', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Relationships between Microstructural Parameters a.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('92', 'RESONANT ULTRASOUND SPECTROSCOPY FOR DEFECT DETECTION IN SINGLE CRYSTAL SUPERALLOY CASTINGS', 'B.R. Goodlet;L.H. Rettberg;and T.M. Pollock ', '2016-12-15', 'nondestructive evaluation;NDE;recrystallization;resonant ultrasound spectroscopy;RUS;finite element;FE;modeling', 'Resonant ultrasound spectroscopy (RUS) has been combined with forward finite element (FE) models of resonance for detection of grain structure defects in single crystal Ni-based superalloys. The nondestructive  evaluation  (NDE)  potential  of  RUS  is demonstrated with experiments on Mar-M247 single crystals that were shot peened and solution heat treated to induce surface recrystallization.  FE  models  using  self-consistent  elastic properties and variable recrystallization depths show excellent agreement with RUS measured results, allowing for the effect of recrystallization on resonance to be isolated and quantified. The validated FE modeling framework is then extended to a turbine blade model for exploring RUS as a NDE technique of grain structure defects in complex geometry components. Extension of RUS to evaluate defects, anomalies, and damage mechanisms relevant to manufacturing process control and component life- cycle management is also discussed.', 'C', 'University of California', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Resonant Ultrasound Spectroscopy for Defect Detect.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('93', 'SELECTIVE ELECTRON BEAM MELTING OF THE SINGLE CRYSTALLINE NICKEL-BASE SUPERALLOY CMSX-4 ¬Æ : FROM COLUMNAR GRAINS TO A SINGLE CRYSTAL', 'arkus Ramsperger;Carolin K√∂rner', '2016-12-15', 'Additive Manufacturing;Powder Processing;Ni-Based Superalloys;Selective Electron Beam Melting;Single-Crystal;CMSX-4 ¬Æ', 'Selective electron beam melting (SEBM) is a powder-bed-based additive manufacturing technology. SEBM offers a great potential to process high performance alloys like intermetallics, e.g. TiAl or FeAl, and Ni-based superalloys, which are hard or non weldable materials with high susceptibility to crack-formation. Especially the high process temperatures during SEBM are beneficial for reducing stresses and warpage. In addition, SEBM works under vacuum  which  guarantees  a  perfect  protection  against contamination. In this contribution, SEBM of the single crystalline nickel-base superalloy CMSX-4 ¬Æ1 is investigated. It is shown that crack formation can be avoided by appropriate processing conditions. Regarding the microstructure, SEBM opens the possibility to tailor the microstructure. Whether a columnar grained or a single crystalline grain microstructure is produced depends on the process strategy used. For the first time it is shown, that it is even possible to produce a single crystalline material by an additive powder bed manufacturing process without any grain selector or a seed crystal. The inherent high cooling rates during SEBM lead to a strong reduction of the length scale of the well-known strong segregations in CMSX-4 ¬Æ to some microns. Therefore, long-time and expensive heat treatments are reduced to minutes for a complete homogenization of the single crystal specimen, even for Re. The specimens produced were investigated by using classical optical-metallography  techniques  and  SEM  imaging. Complementary microprobe element mappings and EBSD measurements were performed for a detailed analysis of the microstructure.', 'C', 'Chair of Materials Science and Engineering for Metals', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Selective Electron Beam Melting of the Single Crys.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('94', 'SEPARATING THE INFLUENCE OF ENVIRONMENT FROM STRESS RELAXATION EFFECTS ON DWELL FATIGUE CRACK GROWTH IN A NICKEL-BASE DISK ALLOY', 'J. Telesman;T.P. Gabb;L.J. Ghosn', '2016-12-15', 'Dwell crack growth;environmental damage;stress relaxation;life prediction', 'Both environmental embrittlement and crack tip visco-plastic stress relaxation play a significant role in determining the dwell fatigue crack growth (DFCG) resistance of nickel-based disk superalloys. In the current study performed on the Low Solvus High Refractory (LSHR) disk alloy, the influence of these two mechanisms were separated so that the effects of each could be quantified and modeled. Seven different microstructural variations of LSHR were produced by controlling the cooling rate and the subsequent aging and thermal exposure heat treatments. Through cyclic fatigue crack growth testing performed both in air and vacuum, it was established that four out of the seven LSHR heat treatments evaluated, possessed similar intrinsic environmental resistance to cyclic crack growth. For these four heat treatments, it was further shown that the large differences in dwell crack growth behavior which still persisted, were related to their measured stress relaxation behavior. The apparent differences in their dwell crack growth resistance were attributed to the inability of the standard linear elastic fracture mechanics (LEFM) stress intensity parameter to account for visco- plastic behavior. Crack tip stress relaxation controls the magnitude of the remaining local tensile stresses which are directly related to the measured dwell crack growth rates. It was hypothesized that the environmentally weakened grain boundary crack tip regions fail during the dwells when their strength is exceeded by the remaining local crack tip tensile stresses. It was shown that the classical creep crack growth mechanisms such as grain boundary sliding did not contribute to crack growth, but the local visco-plastic behavior still plays a very significant role by determining the crack tip tensile stress field which controls the dwell crack growth behavior. To account for the influence of the visco-plastic behavior on the crack tip stress field, an empirical modification to the LEFM stress intensity parameter, Kmax, was developed by incorporating into the formulation the remaining stress level concept as measured by simple stress relaxation tests. The newly proposed parameter, Ksrf, did an excellent job in correlating the dwell crack growth rates for the four heat treatments which were shown to have similar intrinsic environmental cyclic fatigue crack growth resistance.', 'C', 'NASA Glenn Research Center', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Separating the Influence of Environment from Stres.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('95', 'SLIP LOCALIZATION AND HYDROGEN EMBRITTLEMENT OF ALLOY 718', 'Zhenbo Zhang;Gideon Obasi;Roberto Morana; Michael Preuss1', '2016-12-15', 'Superalloy;slip localization;electron channeling contrast imaging,;hydrogen embrittlement', 'In this study, detailed electron microscopy characterization was employed to investigate the plastic deformation behavior and related hydrogen induced embrittlement of a nickel-based superalloy UNS N07718 (Alloy 718).  Transmission Electron Microscopy (TEM) analysis demonstrated that dislocations with slip systems of <110>{111} operate in a localized manner during plastic deformation.  Dislocation slip localization is further revealed by high resolution digital image correlation and Electron Channeling Contrast Imaging (ECCI) techniques, where planar dislocation boundary traces (DBTs) are observed. Both postmortem analysis of the hydrogen charged sample after slow strain rate (SSR) tension and in-situ SSR tension in a Scanning Electron Microscope (SEM) show that cracks tend to initiate and propagate along the DBTs, where dislocation slip localization happens. This phenomenon is rationalized by the evident nucleation of nanoscale voids along the dislocation boundaries, especially at the intersections between non-parallel dislocation boundaries. Hydrogen enhanced localized plasticity, which associates with intensive hydrogen-dislocation interaction, is suggested to be the dominant reason for the hydrogen embrittlement of Alloy 718.', 'C', 'BP International Centre for Advanced Materials', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Slip Localization and Hydrogen Embrittlement of Al.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('96', 'STAGE I FATIGUE CRACK PROPAGATION IN A SINGLE CRYSTALAND A DIRECTIONAL SOLIDIFIED Ni-BASE SUPERALLOY ', 'Motoki SAKAGUCHI;Ryota KOMAMURA;Yuta HOSAKA and Hirotsugu INOUE', '2016-12-15', ' Ni-base superalloy;Stage I fatigue crack propagation;CT specimen;Single crystal;Directional solidified;Grain boundary;Crystal orientation', 'Stage I fatigue crack propagation along crystallographic slip planes in Ni-base superalloys were experimentally investigated at room temperature employing miniature CT specimens. At first, effects of crystallographic orientation on the Stage I fatigue crack propagation were investigated, using a single crystal (SC) Ni-base superalloy, NKH-304, with different combinations of primary and secondary orientations. Based on the test result of the NKH-304, influences of grain orientations and grain boundary on Stage I crack propagation was investigated employing a directional solidified (DS) superalloy, CM-247LC, changing the grain orientation in front of the initial mechanical notchof CT specimen. A series of experiments revealed the Stage I cracking in the SC superalloy was significantly influenced by both primary and secondary crystal orientation, and the grain boundary in the DS superalloy caused the retardation of crack propagation depending on angular difference between crack planes across the grain boundary.  In order to numerically investigate the effect of elastic anisotropy and the geometry of the Stage I crack, a 3-D finite element model for the CT specimen was developed. It was found from fracture mechanics analysis that geometries of 3-D inclined crack, containing mode I, II and II components, played an essential role to determine the driving force of the Stage I crack propagation in the superalloys.', 'C', 'Tokyo Institute of Technology', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Stage I Fatigue Crack Propagation in a Single Crys.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('97', 'STATISTICALASSESSMENTOFFATIGUE-INITIATINGMICROSTRUCTURAL FEATURESINAPOLYCRYSTALLINEDISKALLOY', 'William C. Lenthe;Jean-Charles Stinville;McLean P. Echlin;Tresa M. Pollock', '2016-12-15', ' Fatigue;Twin Boundary;Serial Sectioning;Property Volume Element;Ren¬¥e 88DT', 'Fatigue is the life limiting property of polycrystalline nickel-base superalloys used for turbine disks. Fatigue cracks in Ren¬¥e 88DT frequently initiate in large grains that are in the tail of the size distribution and contain favorably oriented annealing twin boundaries. High resolution three dimensional volumes of Ren¬¥ e 88DT have been collected via TriBeam tomography for analysis of grain structure and twin boundaries. Most twin boundaries were found to be highly coherent, allowing twin boundary inclination to be calculated using orientation measurements collected from two dimensional cross sections. This insight enables identiÔ¨Åcation of fatigue initiating microstructural features in large two dimensional scans, providing initiation site statistics for a signiÔ¨Åcant number of boundaries.', 'C', 'Materials Department', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Statistical Assessment of Fatigue-Initiating Micro.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('98', 'SULFURANDMINORELEMENTEFFECTSONTHEOXIDATION OFBILAYER Œ≥\'+Œ≤ BONDCOATSFORTHERMALBARRIERCOATINGSONREN√âN5', 'DavidJJorgensen;AkaneSuzuki;DonMLipkin;TresaMPollock', '2016-12-15', 'bondcoats;sulfur;cyclicoxidation;reactiveelementeffect', 'Cyclic oxidation tests of five experimental bond coats were conductedat1163‚ó¶C inair. Ahigh-strength Œ≥\'(Ni3Al)coating wascomparedtomonolithic Œ≤ (NiAl)and Œ≥\'+Œ≤ bilayercoatings wherethe Œ≤ layerscontainedeitherhigh-Sandlow-Hf,orlow-S and high-Hf concentrations. Thermal barrier coating lifetimes formonolithic Œ≥\'showeda3-foldincreaseoverthebenchmark (Pt,Ni)Alduetoafailuremechanismchangefromthermomechanicaldegradationforthe(Pt,Ni)Altothermochemical/oxidation degradationforthe Œ≥\'coating. Theresultsofmasschangemeasurementsindicatedthatthemonolithiclow-S/high-Hf Œ≤ coating hada 60% shorterlifetimethanthemonolithic Œ≥\'coating. Interestingly,whenathinlow-S/high-Hf Œ≤ layerisaddedontopofthe Œ≥\'coatingtoformabilayer,thereisasynergistic 40% increase inoxidationlifeoverthemonolithic Œ≥\'coating. Thepresenceof the Œ≤ top-layerdelaysformationofinternalHfO2 pegsandthe growthofspineloxides. HighconcentrationsofSinthe Œ≤-phase were detrimental to the thermally grown oxide adherence and thereforedecreasedcyclicoxidationperformanceandTBClife inboththemonolithic Œ≤ andbilayer Œ≥\'+Œ≤ coatingscomparedto Œ≥\'. Thebilayer Œ≥\'+Œ≤ coatingconceptisapromisingavenuefor improvingthermalbarriercoatinglifeatelevatedtemperatures byprovidingbothrumplingresistanceandoxidationprotection.', 'C', 'UniversityofCaliforniaSantaBarbaraMaterialsDepartment', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Sulfur and Minor Element Effects on the Oxidation .\'+ √ü Bond Coats for Thermal Barrier Coatings on ReneÃÅ N5.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('99', ' SUPERALLOYS FOR ADVANCED ENERGY APPLICATIONS: INCONEL ALLOY 740H ‚Äì A CASE STUDY ON INTERNATIONAL GOVERNMENT-INDUSTRY-UNIVERSITY COLLABORATION John ', 'John deBarbadillo1;Brian Baker1 and Xishan Xie', '2016-12-15', ' Advanced Energy Systems;Alloy 740H;Tube;Pipe;Forging;Welding;Creep Rupture ', 'A number of national and international collaborative projects have been underway for almost twenty years, with the goal of increasing the efficiency of coal-fired power plants. Nickel-base superalloys are enabling materials to achieve the design goals for operating temperature, pressure and service life of Advanced Ultra-supercritical (AUSC) concept plants. Over this time frame, new alloys have been developed, characterized and qualified, fullsize components have been manufactured and engineering designs developed for demonstration plants. INCONEL¬Æ alloy 740H¬Æ, a Œ≥ π-strengthened superalloy formulated specifically for tube and pipe in AUSC power plants, is a key alloy for plants now being designed or under construction. This paper describes the development and qualification of this alloy with emphasis on the collaborative nature of the project. ', 'C', 'Special Metals Corporation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Superalloys for Advanced Energy Applications_ Inco.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('100', ' SYSTEMATIC EVALUATION OF MICROSTRUCTURAL AND THERMO-MECHANICAL EFFECTS ON THE AS-FORGED CONDITION OF ALLOY ATI 718PLUS¬Æ ', 'Ana Casanova;Katja Loehnert;Daniela Huenert;Mark Hardy3;Catherine Rae', '2016-12-15', 'ATI 718Plus;forging;Œ∑ phase;hot compression;double cones;EBSD;recrystallization', 'ATI 718Plus¬Æ is a polycrystalline Ni-base superalloy with applications in static and rotating aero-engine components, in which it relies on the grain boundary precipitation of Œ∑-phase for resistance to intergranular failure. The Œ∑ population initially forms during the first stages of the manufacturing process, and subsequently evolves throughout the often complex thermomechanical route. The control of the Œ∑-phase content and structure during forging defines the customization of the final microstructure. For that reason, a program of double-cone compression tests was designed to examine the influence of the processing parameters on the evolution of different Œ∑ typologies during forging. A framework was developed for the systematic evaluation and quantification of the differentiating features in Œ∑ populations, while the recrystallization behavior and texture development were analyzed by means of EBSD. A FE simulation of the forging process was used to link the microstructural evolution in the testpiece to the local strain and temperature conditions.', 'C', 'Department of Materials Science and Metallurgy', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Systematic Evaluation of Microstructural and Therm.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('101', 'T THE DISTRIBUTION AND RETENTION OF YTTRIUM AND LANTHANUM IN CAST SINGLE CRYSTAL SUPERALLOYS', 'S.P. Leyland;I.M Edmonds;S. Irwin;C.N. Jones;A. Bhowmik;D. Ford;C.M.F. Rae', '2016-12-16', ' Casting;Superalloys;REM;Reactive Elements;yttrium;lanthanum;¬Æ-4', 'Reactive elements (REs) are added to superalloys to improve their resistance to oxidation. They act by gettering free sulphur in the alloy; sulphur which would otherwise migrate to the oxide alloy interface thus weakening the adhesion of the oxide [1]. However, RE dopants can be detrimental to mechanical properties, lowering the incipient melting point and increasing the propensity to precipitate TCP phases [2].  We report a systematic series of casting trials designed to quantify the losses of REs during casting and heat treatment of the alloy CMSX-4¬Æ1. [3]. These results show a consistent pattern, demonstrating that the principal factor of RE losses are the nature of the mold and core material and the surface area to volume ratio of the cast component. Several other process parameters are identified that can be carefully controlled to minimise loss. These include the vacuum level, casting temperature and solidification withdrawal time. The location, composition and structure of the RE-containing phases and outlined how they affect the likely supply of these elements, and hence the environmental performance, throughout the service life of the component. ', 'C', 'Materials Science and Metallurgy', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Distribution and Retention of Yttrium and Lant.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('102', 'The Effect of Alloying Elements on the High Temperature Oxidation of Solid-Solution Strengthened Ni-base Superalloys ', 'Dae Won Yun;Y. S. Yoo;H. W. Jeong;and S. M. Seo ', '2016-12-15', ' Oxidation;Nickel;Superalloy ', 'The effect of major and minor alloying elements on the cyclic oxidation resistance of solid-solution strengthened Ni-base superalloys was studied. Ni-base superalloys with various Cr, W, Mo, Mn, Si, Al, La, C and B contents were produced. The samples were exposed at 1150 ¬∞C in ambient air for 15 min. and then cooled down in room temperature for 5 min. cyclically. Weight changes after the cyclic oxidation were analyzed as a function of alloying contents. The simple statistical spalling model was used in some cases. With the simple statistical spalling model, the effect of alloying elements on the adhesion of oxide scale and on the oxidation rate can be analyzed respectively. The addition of W and Mo was beneficial to the oxidation resistance only in alloys with 18 wt.% Cr. Al reduced oxidation rate and improved adhesion of scale, while Si only reduced oxidation rate. The database produced by this study can be employed for alloy development tools such as neural network methods to develop Nibase superalloys with improved oxidation resistance.', 'C', 'Korea Institute of Materials Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Effect of Alloying Elements on the High Temper.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('103', 'THE INFLUENCE OF THE STARTING GRAIN SIZE DURING HIGH-TEMPERATURE GRAIN BOUNDARY ENGINEERING OF NL-BASE SUPERALLOY RR1000 ', 'Martin Detrois;John Rotella;Robert L. Goetz;Randolph C. Helmink;Sammy Tin', '2016-12-15', ' Grain boundary engineering;Twin;RR1000;Recrystallization;Œ£3;Processing ', 'Traditional grain boundary engineering (GBE) techniques employ iterations of cold work followed by short time annealing to obtain a high proportion of Œ£3/twin boundaries. Although numerous investigations reported the improvement of the properties of various polycrystalline materials using GBE, this approach is not suitable for the fabrication of large and complex Ni-base superalloys components. In this investigation, samples of Ni-base superalloy RR1000 with a fine (~5.9 ¬µm) and a medium (~10 ¬µm) starting grain size were deformed at various temperatures, strains, and strain rates to study the effect of thermal-mechanical processing parameters on the formation of Œ£3 boundaries upon annealing. As the magnitude of stored strain energy increased to promote strain-induced boundary migration (SIBM) and the formation of Œ£3 boundaries during annealing, this led to an overall decrease in the density and fraction of pre-existing twin boundaries in the as-deformed microstructure. Consequently, subsequent annealing only resulted in minor changes in the Œ£3 density and fraction as a function of the deformation parameters. The larger starting grain size in RR1000 was less conducive to the formation of Œ£3 boundaries as strain incompatibilities and twin reorientations occurred when dislocation plasticity mechanisms were operative. This increased the tendency of the alloy to recrystallize and fewer Œ£3 boundaries formed within the microstructure upon annealing.', 'C', 'Illinois Institute of Technology', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Influence of the Starting Grain Size during Hi.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('104', 'THE ROLE OF LOCAL CHEMICAL COMPOSITION FOR TCP PHASE PRECIPITATION IN      Ni-BASE AND Co-BASE SUPERALLOYS ', 'T. Hammerschmidt;J.Ko√ümann;C.H. Zenk;S. Neumeier;M. G√∂ken;I. Lopez-Galilea;L. Mujica Roncery;S. Huth;A.Kostka;W.Theisen and R. Drautz', '2016-12-15', 'Ni-base superalloys;Co-base superalloys;structure map;topologically close-packed phases;intermetallic precipitates;solidification', 'The precipitation of topologically close-packed (TCP) phases in single-crystal superalloys is highly undesirable due to the detrimental effect on the mechanical properties. The TCP phases bind atoms responsible for the solid solution strengthening of the Œ≥ phase (Re, W, Mo), as well as elements that are important for the formation of the Œ≥\' phase (Ti, Ta). A thorough understanding of TCP phase precipitation is therefore a prerequisite for the design of future superalloys. The thermodynamic stability of TCP phases as bulk material is meanwhile well understood. However, little is known about the factors that govern the stability of the experimentally observed precipitates of TCP phases within the superalloy matrix. The focus of this paper is the role of the local chemical composition for the stability of TCP phase precipitates.  ', 'C', 'Interdisciplinary Centre for Advanced Materials Simulation (ICAMS)', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Role of Local Chemical Composition for TCP Pha.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('105', 'THE ROLE OF THE BASE ELEMENT IN Œ≥ STRENGTHENED COBALT/NICKEL-BASE SUPERALLOYS', 'C.H. Zenk;S. Neumeier;M. Kolb;N. Volz;S.G. Fries;O. Dolotko;I. Povstugar;D. Raabe;M. G¬®oken', '2016-12-15', ' Co-base superalloys;Lattice misÔ¨Åt;Atom probe tomography;Partitioning behavior;Creep', 'Two series of polycrystalline model superalloys ‚Äì one without and one containing Cr ‚Äì with varying Ni/Co ratios and otherwise constant element contents were produced and are characterized by a variety of methods. All alloys form a Œ≥/Œ≥ microstructure after a standard aging treatment at 900‚ó¶C for 100h. Upon long term aging for 1100h, the Cr containing Co-base alloy forms undesired intermetallic phases. Liquidus and solidus temperatures are hardly inÔ¨Çuenced by the Ni/Co content, but the Œ≥ solvus temperature is strongly decreasing with increasing Co content. Addition of Cr to the alloy series lowers liquidus and solidus, but does not inÔ¨Çuence the solvus temperature substantially. Neutron diÔ¨Äraction experiments conducted on the Cr containing alloys show that the misÔ¨Åt is negative for alloys rich in Ni, but linearly increases to positive values with increasing Co content. 3D atom probe tomography shows that W preferentially partitions to the Œ≥ phase for the Ni-base alloys, whereas it is enriched in Œ≥ for the Co-base alloys. The partitioning of Co (Œ≥), Cr (Œ≥) and Al ( Œ≥) to their respective phases is much more pronounced in Ni rich alloys, i.e. all elements distribute more equally in the Co-base alloys. Nanoindentation on the Cr free alloy variants reveals that the hardness of the Co-base alloy is higher than the one for the Ni-base alloy. However when Cr is present in the alloy, the hardness of the Ni-base alloy is superior. The same behavior is observed in compressive creep experiments at 900‚ó¶C. The addition of Cr strongly improves the creep resistance of the Ni-base alloy, whereas it slightly worsens the performance of the Co-base alloy.', 'C', 'Friedrich-Alexander-Universit¬®at Erlangen-N¬®urnberg (FAU)', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Role of the Base Element in .\' Strengthened Cobalt_Nickel-base Superalloys.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('106', 'THERMAL CYCLING CREEP RESISTANCE OF Ni-BASED SINGLE CRYSTAL SUPERALLOYS', 'Jonathan CORMIER ', '2016-12-15', 'Single crystal Ni-based superalloys;Thermal cycling, Creep;Microstructure Stability', 'This paper reviews the non-isothermal creep resistance of Nibased single crystal superalloys. For this, the creep resistance under very high temperature thermal cycling conditions of ten different <001>-oriented Ni-based single crystal superalloys from the first to the fourth generation has been investigated. Thermal cycling creep experiments consist of repeated short overheatings at 1105 ¬∞C and 1160 ¬∞C applied during a creep test at      1050 ¬∞C/120 MPa. Such thermal cycling conditions are representative of the most damaging stages of the certification procedures of small gas turbines in which creep is a life limiting factor for uncooled blades. It is shown that the creep resistance under such non-isothermal creep conditions is primarily controlled by the J‚Ä≤ volume fraction remaining at high temperature, especially during the temperature spikes at 1160 ¬∞C. Indeed, higher J‚Ä≤-solvus alloys exhibit better creep resistance under such thermal cycling conditions. It is also shown that increasing the rhenium content does not necessarily results in a better thermal cycling creep resistance and that having a good J‚Äô morphological stability (i.e. slow J‚Ä≤ rafting kinetics and J/J‚Ä≤ topological inversion) results in a better non-isothermal creep life. From the present experimental characterization, some guidelines for the development of non-isothermal creep resistant alloys are presented. ', 'C', 'Institut Pprime', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Thermal Cycling Creep Resistance of Ni-Based Singl.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('107', 'THERMAL STABILITY OF CAST AND WROUGHT ALLOY RENE 65 ', 'Wessman;Andrew;Laurence;Aude;Cormier,Jonathan;Villechaise;Patrick;Billot;Thomas;Franchet;Jean-Michel ', '2016-12-15', 'Rene 65;Cast and Wrought;Turbine Disks;Microstructure;Gamma Prime;Mechanical Properties;Stability ', 'The cast and wrought nickel superalloy Rene 65 has been recently introduced to provide a gamma prime strengthened alloy with high performance at temperatures exceeding 700 ¬∞C at a lower cost than powder metallurgy alloys.  While similar in chemistry to the PM alloy Rene 88DT, Rene 65 is typically used in a subsolvus form with finer grain size and a very different gamma prime distribution.  This study provides an overview of the structure of Rene 65, and the effects high temperature exposures over long times have on the structure and mechanical properties of the alloy. ', 'C', 'GE Aviation', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Thermal Stability of Cast and Wrought Alloy Rene 6.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('108', 'SINGLE-CRYSTAL SUPERALLOY JOINING', 'Akane Suzuki;Jeffrey Schoonover;Chen Shen;David Wark', '2016-12-15', 'Diffusion brazing;Transient liquid phase bonding;Boron;Ren√© N5', 'A new process route of diffusion brazing has been identified forjoining  Ni-base single-crystal  superalloys. This  process  wasdeveloped through an understanding of microstructure evolutionobserved during conventional diffusion brazing of a single-crystalsuperalloy Ren√© N5 with interlayer materials containing B  as amelting point depressant. It wasfound that the interlayer does notfully melt during high temperature joining heat treatment due tothe fast diffusion of B from the interlayer into the substrate, andthat grain coarsening, instead of epitaxial growth, is responsiblefor producing joints free of bond line. A new two-step joining heattreatment process route was established to effectively  use gralncoarsening  and minimize the I  formation of the  grain  defects.Diffusion calculations were applied to predict the distribution of Band thus avoid incipient melting during the heat treatments. The Ren√©  N5  joined  by  the  new  process  demonstrated  high temperature tensile properties equivalent to those of the single-crystal Ren√© N5, and the joined specimens did not fail  at thejoints.', 'C', 'GE Global Research', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Single-Crystal Superalloy Joining.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('109', 'SUSTAINED PEAK LOW-CYCLE FATIGUE IN SINGLE CRYSTALS WITH EQUILIBRIUM Œ≥-Œ≥\'', 'M.A.Lafata;L.H.Rettberg;C. Mercer;T.M. Pollock', '2016-12-15', 'Bond Coat;Ren√© N5;TMS- l38A;Low-Cycle Fatigue', '  Damage due to fatigue with compressive holds developed duringcycling of two single crystal superalloys, Ren√© N5 and TMS- l38A,with  equilibrium (EQ)  Y-Y  bond coatings has been examined.Isothermal  strain-controlled  fatigue  tests  with  a two  minutecompressive hold were performed at 1093 C with a total  strainrange of 0.35%. Oxide-assisted fatigue cracks initiate at the bondcoat surface before penetrating into the single crystal superalloy.Crack depths  and  spacing were characterized in interrupted andfailed specimens  to investigate crack initiation and propagationbehavior. The EQ coatings were found to enhance crack penetrationrates compared  to previous studies  on  uncoated superalloysand √à-based bond coats.  Electron backscatter diffraction andenergy dispersive spectroscopy were used  to characterize themicrostructure of the EQ coating and oxides on the cracks. The EQcoating was found to have a coarse two-phase structure and a small (3-4 um) grain size.  The implications of coating microstructure,strength, and thickness are discussed with regard to fatigue lifetime.', 'C', 'National Institute for Materials Science', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\Sustained Peak Low-Cycle Fatigue in Single Crystal.\' Coatings.pdf', '0', '0', null);
INSERT INTO `data_literature_dump` VALUES ('110', ' THE FORMATION MECHANISM, INFLUENCING FACTORS AND PROCESSING CONTROL OF', 'Yafeng Li;Lin Liu;Taiwen Huang;Dejian Sun;Jun Zhang;Hengzhi Fu', '2016-12-15', 'Directional solidification;Single crystal;Stray grain;Mechanism;Influencing factors;Control methods', '  The thermal prof√≠le of a directionally solidifying nickel-basedsingle crystal (SX) turbine blade was simulated using a Procastfinite element technique. The result showed that the local thermalprofile in the platform  is  wave-shaped rather than a planar orconsistent concave.  Such a distributed thermal profile forms anisolated thermal undercooling zone in the platform end and affectsthe dendritic branching process into the platform region. Based onthe thermal and grain growth analyses, the criterion of stray grainformation was proposed as a competition process on the time ofthe dendritic branching from the airfoil to the platform end andthe cooling of the platform end to the heterogeneous nucleationtemperature. The influencing factors, namely the withdrawal rate,the directional solidification method, the platform dimension, thealloy  composition  and the  crystal orientation  on stray  grainformation were then systematically investigated according to thecriterion.  Several  stray grain (SG)  controlling techniques withdifferent mechanisms were proposed and analyzed based on the thermal evolution process.', 'C', 'State Key Laboratory of Solidification Processing', '0', '0', '', '', '', 'D:\\\\superlloy\\\\literature\\\\piki\\\\The Formation Mechanism, Influencing Factors and P.pdf', '0', '0', null);
